(6, 6, 'AWES001', 0, '2010-11-24', 'Off Licence', 'Sprits & Liqueurs', 'Gin', 'Bombay Sapphire', '', 'Distilled London dry gin.\n\nDistilled from 100% grain neutral spirit from a 1761 recipe.\n\nThe incomparable taste of Bombay Sapphire is the result of ten carefully selected botanical ingredients coupled with a unique distillation process. Unlike some gins, which "boil" their botanicals together with the spirit, Bombay Sapphire distills its spirit alone. The spirit vapour gently passes through a copper basket containing the botanicals. This infuses the subtle aromatic flavours from each of the botanicals into the spirit for a cleaner, crisper, more balanced taste.', '', '', 'The Bombay Spirits Company,\nLondon,\nW1B 3HH.', 'The Bombay Spirits Company,\nLondon,\nW1B 3HH.\nwww.bombaysapphire.com', '', '', '', '', '', '18 Years (Statutory)', 'Pack - Glass ', '', '', '208', '70', '70', 'Gross Weight: 93', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:50', '2016-06-20 01:50:50', NULL),
