(10, 10, 'AEJG001', 0, '2011-06-20', 'Off Licence', 'White Wine', 'American', 'Barefoot', '', 'Moscato - White Californian Wine.\n\nFootnotes\nBarefoot Moscato is a sweet wine with hints of delicious mouth-watering juicy peach and apricot flavours. Notes of lemon and orange citrus compliment a crisp refreshing finish. Barefoot Moscato is perfect with spicy Asian cuisine, light desserts, fresh fruits, and mild cheeses.', '', '', 'Barefoot Cellars,\nModesto,\nCa. 95354,\nU.S.A.\n\nImported by:\nBarefoot Cellars,\nSwan House,\nCowley Business Park,\nUxbridge,\nUB8 2AD,\nU.K.', 'Barefoot Cellars,\nSwan House,\nCowley Business Park,\nUxbridge,\nUB8 2AD,\nU.K.', '', '', '', '', '', '18 Years (Statutory)', 'Pack - Glass ', '', '', '302', '74', '74', 'Gross Weight: 11', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:50', '2016-06-20 01:50:50', NULL),
(11, 11, 'AWES001', 0, '2011-08-24', 'Off Licence', 'Sprits & Liqueurs', 'Gin', 'Bombay Sapphire', '', 'Distilled London dry gin\n\nHand selected exotic botanicals\n\nThe tantalising, smooth and complex taste that you experience when you sip Bombay Sapphire gin, is described as fresh citrus and juniper flavours combined with an elegant light spicy finish.\nThe flavours of the botanicals are captured through a delicate distillation process called Vapour Infusion to give Bombay Sapphire its distinctive taste.\n\nGrains of Paradise from West Africa\nCubeb Berries form Java\nCassia Bark from Indio-China\nAlmonds from Spain\nLiquorice from China\nJuniper Berries from Italy\nLemon Peel from Spain\nCoriander (Seeds) from Morocco\nAngelica (Root) from Sarony\nOrris (Iris Root) from Italy', '', '', 'Distributed by:\nBacardi-Martini Ltd.,\nKings Worthy,\nWinchester,\nHampshire,\nSO23 7TW.', 'Bacardi-Martini Ltd.,\nKings Worthy,\nWinchester,\nHampshire,\nSO23 7TW.', '', '', '', '', '', '18 Years (Statutory)', 'Pack - Glass ', '', '', '232', '79', '80', 'Gross Weight: 12', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:50', '2016-06-20 01:50:50', NULL),
