(16, 16, 'APBA001', 0, '2012-06-01', 'Off Licence', 'White Wine', 'Italian', 'Italia', '', 'Prosecco - White Italian Wine\n\nThe One-Liner\nLight and creamy Prosecco - great with or without food.\n\nTasting Note\nPale green with lemon hues. Hints of apple and peach on the nose. Light and delicate with citrus notes - this wine is dry, soft and creamy.\n\nIn the Vineyard\nThe Prosecco grapes are sourced by Adria Vini from the Treviso area and vines approximately 17 years old. They are hand-picked ready for vinification.\n\nIn the Winery\nFermented in stainless steel.', 'Producer Details\nSet up in 2003, Adria Vini is a winemaking venture jointly owned by Boutinot and Araldica Vini Piemontesi, the leading co-operative in Piemonte. All areas of production, from grape selection through to vinification, maturation, blending and bottling are meticulously overseen by Araldica''s Claudio Manera and Lella Burdese. Working closely with growers and cooperatives, our aim is to produce a range of authentic, well-priced wines south of Milan, Friuli and the Veneto, with the addition of Prosecco, and Grillo and Catarratto wines from Sicily. The reds come from mature, low yielding vineyards in Sicily, Puglia and Abruzzo, the source of some Europe''s most undervalued and characterful wines. Our most recent project has brought Cannonau and Vermentino from Sardinia to the portfolio.', '', '', '', '', '', '', '', '', '18 Years (Statutory)', 'Pack - Glass ', 'Suitable for Vegans', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:50', '2016-06-20 01:50:50', NULL),
(17, 17, 'ACAN006', 0, '2012-08-30', 'Off Licence', 'White Wine', 'Italian', 'Italia Plaza Centro', '', 'Prosecco - White Italian Wine\n\nA classic Italian sparkling wine made from the Glera grape grown in the rolling vineyards of Veneto in North East Italy. A lively, refreshing wine full of bright citrus fruit flavours with background floral notes.', '', '', 'Campegine in Vazzola (TV),\nItaly.', 'Campegine in Vazzola (TV),\nItaly.', '', '', '', '', '', '18 Years (Statutory)', 'Pack - Recyclable ', '', '', '326', '87', '87', 'Gross Weight: 14', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:50', '2016-06-20 01:50:50', NULL),
(18, 18, 'ALSL001', 0, '2013-02-04', 'Grocery', 'Confectionery', 'Block Chocolate Bars', 'Lindt', '', 'Extra fine dark chocolate\n\nExcellence 70% cocoa. An extra refined and delicately fragrant smooth dark chocolate which has a strong, but not too intense, cocoa flavour with subtle fruit undertones of natural vanilla.', 'Enliven your senses with the ultimate chocolate luxury, Lindt Excellence. With this range you will discover the expertise and craftsmanship of our Master Chocolatiers in blending the most aromatic cocoa beans with the finest ingredients to create a rich and refined chocolate of intense flavour and elegant texture.', '', 'Imported by:\nLindt & Sprüngli (UK) Ltd.,\nTop Floor,\n4, New Square,\nFeltham,\nMiddlesex,\nTW14 8HA.', 'Lindt & Sprüngli (UK) Ltd.,\nTop Floor,\n4, New Square,\nFeltham,\nMiddlesex,\nTW14 8HA.\nwww.lindt.com', '', '', '', '', '', '', '', '', '', '193', '89', '8', 'Gross Weight: 11', 'Cocoa Mass,Sugar,Cocoa Butter,Natural Bourbon Vanilla Beans,Cocoa Solids: 70% minimum', '', 'May Contain Milk\nMay Contain Almonds\nMay Contain Hazelnuts\nMay Contain Soya\\Soybeans', '', '', '', 'per 40 g Serving: Energy : 872 kJ/, : 208 kcal, Protein : 3.2 g, Fat, total: 16.0 g,  - saturated: 9.6 g, Carbohydrate, total: 13.2 g,  - sugars : 11.2 g, Sodium : 24 mg\nper 100 g: Energy : 2180 kJ/, : 520 kcal, Protein : 8 g, Fat, total: 40 g,  - saturated: 24 g, Carbohydrate, total: 33 g,  - sugars : 28 g, Sodium : 60 mg', 'Per 100g/ml', '2180', '520', '40', '24', '33', '28', '8', '', '0.06', '', '', 'per 40 g Serving', '872', '208', '16', '9.6', '13.2', '11.2', '3.2', '', '0.024', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:50', '2016-06-20 01:50:50', NULL),
(19, 19, 'ACOE001', 0, '2013-02-11', 'Off Licence', 'Sprits & Liqueurs', 'Gin', 'Portobello Road', '', 'This bottle of Portobello Road Gin 171 was created by the award-winning licensed victualers of the Ginstitute Messrs. Gerard Feltham, Jake F Burger and Paul Andrew Lane. Each individually numbered bottle bearing a triptych of their unique signatures. Every drop of Portobello Road Gin is distilled under the watchful eye of eight-generation gin distiller Mr Charles Maxwell.\nThe recipe calls for a blend of nine completey natural botanicals and eschews the contemporary trend for ever more esoteric ingredients, instead saluting London''s distillers of the past. A classic botanical selection, with cassia bark and nutmeg concomitant, contrives a timeless London Dry Gin with a depth of flavour and character to suit all occasions and libations.\nPortobello Road Gin: A capital bracer\n\nI do undertake to manufacture and sell distilled London dry gin of only the highest quality, using only natural botanicals and grain neutral spirit of 100% purity. This gin is guaranteed to be as fresh, dry, lively and perfect as it was on the day it was made.\nJ Burger, G. Feltham, P. Lane', '', '', 'The Ginstitute:\n171 Portobello Road,\nLondon.', 'To further your knowledge and appreciation of gin and its place in Old Blighty''s history please come and join us at:\nThe Ginstitute:\n171 Portobello Road,\nLondon.', '', '', '', '', '', '18 Years (Statutory)', 'Pack - Recyclable ', '', '', '310', '75', '75', 'Gross Weight: 12', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:50', '2016-06-20 01:50:50', NULL),
