(23, 23, 'ASCB003', 0, '2013-04-03', 'Off Licence', 'Beer & Cider', 'Cider', 'Symonds', '', 'A distinctly applely warming cider with a dry aftertaste.  It has fruity notes of apple.\n\nOriginally made by Symonds, founded in 1727 Scrumpy Jack is the brand that carries the generic name for farmhouse cider. Scrumpy Jack appeals to the discerning drinker who enjoys a refreshing drink with flavour and strength, similar to a real ale drinker. The taste of the English countryside, made entirely from locally grown bitter-sweet cider apples, including Dabinett and Chisel Jersey, creating a premium cider with a natural fruity aroma and superior crisp taste.', '', '', 'Symonds,\nHereford,\nHR4 0LE.', 'Symonds,\nHereford,\nHR4 0LE.\nConsumer Careline 0845 303 0351.\nconsumercare@bulmers.com', '', '', '', '', '', '18 Years (Statutory)', 'Pack - Recyclable ', '', '', '', '', '', '', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:50', '2016-06-20 01:50:50', NULL),
(24, 24, 'APRB001', 0, '2013-04-02', 'Off Licence', 'Other Alcoholic Beverages', 'Flavoured Alcoholic Drinks', 'Pernod', '', 'In 1805, Henri-Louis Pernod opened the first French absinthe distillery. As Pernod grew in popularity, creating a true mystique, it was wholly embraced by artists of the era, who enjoyed it during the "Green Hour". Based on the original recipe, Pernod Absinthe Supérieure is enjoyed diluted either in the traditional way or in refreshing long drinks such as the Pernod Green Beast.®', '', '', 'Distributed by:\nPernod Ricard UK,\nHounslow,\nTW3 1HY.', 'Pernod Ricard UK,\nHounslow,\nTW3 1HY.\nwww.pernodabsinthe.com', '', '', '', '', '', '18 Years (Statutory)', 'Pack - Glass ', '', '', '300', '81', '81', 'Gross Weight: 13', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:50', '2016-06-20 01:50:50', NULL),
(25, 25, 'APFC001', 0, '2013-04-11', 'Off Licence', 'Red Wine', 'Australian', 'Yellow Tail', '', 'Cabernet Sauvignon - Red Australian Wine.\n\nAromas: crushed blackberries with sweet mocha\nFlavours: blackcurrant fruit & a velvety finish', 'For 3 generations the Casella family has been making wine at their winery in the small town of Yenda, situated in South Eastern Australia. It is here that [yellow tail] is created with a simple purpose in mind; to make great wine that everyone can enjoy.\n[Yellow tail] is everything a great wine should be. It''s approachable, fresh, flavoursome and has a personality all of its own.', '', 'Casella Wines,\nWakley Rd,\nYenda,\nAustralia.\n\nImported by:\nPercy Fox & Co,\n12 Brick Street,\nPark Lane,\nLondon,\nW1J 7ET,\nUnited Kingdom.', 'Percy Fox & Co,\n12 Brick Street,\nPark Lane,\nLondon,\nW1J 7ET,\nUnited Kingdom.\nwww.yellowtailwine.com', '', '', '', '', '', '18 Years (Statutory)', 'Pack - Recyclable ', 'Suitable for Vegans\nSuitable for Vegetarians', '', '', '', '', '', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:51', '2016-06-20 01:50:51', NULL),
(26, 26, 'AZON001', 0, '2013-08-15', 'Off Licence', 'Other Wines', 'Sparkling Other', 'Dino', '', 'Prosecco - White Italian Wine\n\nGorgeous green apple and pear aromas melt into a lively, vibrant, soft fizz, made from the Glera grape. Brimming with lemony freshness. The vineyards in the north of Italy are dramatically beautiful, and produce the perfect grapes for this authentic Prosecco.', '', '', 'Bottled by:\nCVZ SpA,\nGambellara,\nItalia.', 'CVZ SpA,\nGambellara,\nItalia.', '', '', '', '', '', '18 Years (Statutory)', '', 'Suitable for Vegetarians', '', '314', '85', '85', 'Gross Weight: 13', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:51', '2016-06-20 01:50:51', NULL),
(27, 27, 'AMUK001', 0, '2013-10-24', 'Off Licence', 'Sprits & Liqueurs', 'Cognac & Rum', 'Courvoisier', '', 'Courvoisier cognac\n\nThe Blend\nCourvoisier VS cognac is a blend aged for between four and seven years. Using grapes from the Fins Bois and Petite Champagne crus it provides complex fruity notes, richness and depth unmatched by any other VS in the market.\n\nTasting Notes\nThe fusion of young and older cognacs gives Courvoisier VS cognac a fruity, delicate taste and a bouquet suffused with ripe fruit and spring flowers. The aroma is rich, fresh and oaky, balanced with the vigour of a young cognac.', 'Courvoisier has been producing the finest cognacs for centuries and was appointed ‘supplier to the Imperial Courts of Napoleon III’. Courvoisier is the only cognac brand to be awarded ‘Le Prestige de La France’, France’s highest award for excellence. We are obsessive about the craft of cognac making and control the entire process from grape to barrel to bottle. We are the only cognac house to control the entire cognac-making process, even the oak in which our precious ‘eaux de vie’ are aged.', '', 'Cognac Courvoisier,\n16200 Jarnac,\nFrance.', 'Cognac Courvoisier,\n16200 Jarnac,\nFrance.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '189', '88', '36', 'Gross Weight: 49', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:51', '2016-06-20 01:50:51', NULL),
(28, 28, 'APBA001', 0, '2013-08-16', 'Off Licence', 'Red Wine', 'South African', 'The Secretary Bird', '', 'Merlot - White South African Wine\n\nThe Secretary Bird, a name deriving from it''s quill like feathers, is a familiar site in the open grasslands of the Western Cape and one of South Africa''s most treasured national birds. Grown from vines in the Western Cape, this merlot strikes a balance between red berry fruit and a long chocolaty finish. A rich, full bodied red, with poise and elegance. This hearty wine will match any food with equal depth, try with roast red meat or a cheese board.', '', '', '', '', '', '', '', '', '', '18 Years (Statutory)', 'Bottle - Glass - Widely Recycled ', 'Suitable for Vegetarians', '', '', '', '', '', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:51', '2016-06-20 01:50:51', NULL),
(29, 29, 'APBA001', 0, '2013-08-16', 'Off Licence', 'White Wine', 'South African', 'The Secretary Bird', '', 'Sauvignon Blanc - White South African Wine\n\nThe Secretary Bird, a name deriving from it''s quill like feathers, is a familiar site in the open grasslands of the Western Cape and one of South Africa''s most treasured national birds. Grown from vines in the Western Cape, this crisp and fruity Sauvignon Blanc has lifted green fruit aromas, complemented by subtle flavours of or ripe apples, citrus acidity and a long, mineral finish. A versatile wine to match with a host of foods.', '', '', '', '', '', '', '', '', '', '18 Years (Statutory)', 'Bottle - Glass - Widely Recycled ', 'Suitable for Vegetarians', '', '', '', '', '', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:51', '2016-06-20 01:50:51', NULL),
