(34, 34, 'ANEG001', 0, '2013-12-02', 'Off Licence', 'White Wine', 'Australian', 'Oxford Landing', '', 'Sauvignon Blanc - White Australian Wine.\n\nThis wine is full of characters - intense tropical fruit punch.', 'Oxford Landing Estates is a place of spiritualism and life. Dudley and Bill, Vineyard Managers long since passed, are still on duty, revered by all who toil today.\nOn a warm day, reclining against a River Gum, profound stillness; on a clear night, gazing upward, millions of bright stars. This is a remarkable place and we treat it with respect.', '', 'Oxford Landing Estates,\nPMB 31 Waikerie,\nSouth Australia,\nAustralia,\n5330.', 'Negociants UK Ltd.,\nDavenport House,\nHarpenden,\nAL5 4EW,\nU.K.', '', '', '', '', '', '18 Years (Statutory)', '', 'Suitable for Vegans\nSuitable for Vegetarians', '', '299', '77', '77', 'Gross Weight: 12', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:51', '2016-06-20 01:50:51', NULL),
