(50, 50, 'ASNL001', 0, '2014-07-18', 'Off Licence', 'Beer & Cider', 'Other Lager/Beer', 'Samuel Adams', '', 'Samuel Adams is handcrafted in single batches with extraordinary care and attention to detail. Following my great-great grandfathers recipe, we use only classic ingredients: hand-selected Hallertau Mittlefrueh and Tettnang Tettnanger hops, two-row summer barley and pure water. No other American lager matches this rich robust and complex taste. Cheers!\nJim Koch', '', '', 'Brewed and bottled by:\nShepherd Neame Ltd,\n17 Court Street,\nFaversham,\nME13 7AX.', 'Shepherd Neame Ltd,\n17 Court Street,\nFaversham,\nME13 7AX.\nwww.samueladams.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '225', '59', '59', 'Gross Weight: 53', '', '', 'Contains Barley\nContains Gluten', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:52', '2016-06-20 01:50:52', NULL),
(51, 51, 'AHAL004', 0, '2014-08-13', 'Off Licence', 'Beer & Cider', 'Premium Ale', 'Badger', '', 'As the story goes, at one Dorset inn, inquisitive ferrets used to sneak a sample of their local brew. The sweet nutty palate, hoppy aroma and hint of Seville oranges give this tawny ale its distinctive personality. Perfect with a creamy Cheddar or indulgent pork pies.\n\nSee - Tawny, light golden brown\nSmell - Delicate spicy hop, orange, malty\nTaste - Malty, sweet/bitter balance', 'We''ve been brewing in the heart of Dorset since 1777.', '', 'Hall & Woodhouse Ltd,\nBlandford,\nDorset,\nDT11 9LS,\nUK.', 'Hall & Woodhouse Ltd,\nBlandford,\nDorset,\nDT11 9LS,\nUK.\nwww.badgerales.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '237', '71', '71', 'Gross Weight: 81', '', '', 'Contains Barley\nContains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:52', '2016-06-20 01:50:52', NULL),
(52, 52, 'ASNL001', 0, '2014-09-04', 'Off Licence', 'Beer & Cider', 'Light Brown & Mild Ales', 'Shepherd Neame', '', 'A classic Kentish strong ale, Bishops Finger takes its name from the name of an ancient signpost on the pilgrims way pointing pilgrims to the Shrine of Thomas A Becket at Canterbury Cathedral.\nOne of the oldest names in British beer, this classic British ale is brewed with chalk-filtered mineral water drawn from deep beneath the brewery and Shepherd Neame''s signature Kentish hops. Its authenticity is assured by its EU protected geographical indication status.\n\nSee: Chestnut brown\nSmell: Roast, Toffee, Berries\nTaste: Rich, Fruity, Bitter', '', '', 'Brewed & bottled by:\nShepherd Neame Ltd,\nFaversham,\nKent,\nME13 7AX,\nEngland.', 'Shepherd Neame Ltd,\nFaversham,\nKent,\nME13 7AX,\nEngland.\nwww.shepherdneame.co.uk', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '220', '76', '76', 'Gross Weight: 83', 'Water,Barley,Hops and Malt', '', 'Contains Barley\nContains Gluten', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:52', '2016-06-20 01:50:52', NULL),
