(103, 103, 'ASCB001', 0, '2014-12-22', 'Off Licence', 'Beer & Cider', 'Other Lager/Beer', 'Desperados', '', 'Desperados is a Tequila Flavoured Beer. A distinctive combination that shakes up traditions in the beer market. A light & refreshing taste profile balanced with spicy and lemony notes for sweetness. (5.9% ABV)', 'Desperados, the Original Tequila Flavoured Beer', 'Beer flavoured with tequila', 'Heineken UK Limited,\n3-4 Broadway Park,\nEdinburgh,\nEH12 9JZ.', 'Heineken UK Limited,\n3-4 Broadway Park,\nEdinburgh,\nEH12 9JZ.\ncustomerservices@desperadosbeer.co.uk', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '233', '60', '60', 'Gross Weight: 59', 'Water,Malted Barley,Glucose Syrup,Sugar,Citric Acid,Hop Extract Flavourings (75% Tequila)', '', 'Contains Barley', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:54', '2016-06-20 01:50:54', NULL),
(104, 104, 'AHIS002', 0, '2014-12-09', 'Off Licence', 'Sprits & Liqueurs', 'Gin', 'The King of Soho', '', 'The Gin\nThe King of Soho is a London Dry Gin distilled in the heart of London using traditional methods; a complex spirit crafted with 12 botanicals to our unique flavour profile. The beautiful design of the bottle embodied the characteristics that make Soho unique.\nWhile remaining true to its London Dry heritage it has a delicate combination of sweetness, citrus and earthiness and a hint of grapefruit bitterness.\nA modern classic, it is complex yet harmonious and ideal for cocktails and drinks where the spirit is King.\nWith this great tasting gin we celebrate the Spirit of Soho!', 'The Story\nPaul Raymond was a man who played a pivotal role in the cultural and social liberation of British society. He revolutionized the district of Soho and became affectionately known as ''The King of Soho''. His son Howard decided to capture the qualities that make Soho unique in a new brand as a tribute to his Father. Paul Raymond helped Soho to become an area rich in creativity, music, art and modern culture. These elements are captured in the design of the bottle.\nWith this authentic London Dry Gin we celebrate with you the Spirit of Soho.', 'London Dry Gin', 'West End Drinks Ltd,\nCardinal House,\n39-40 Albemarle Street,\nLondon,\nW1S 4TE.', 'Hi-Spirits Ltd,\n174 Terrace Road,\nWalton-on-Thames,\nKT12 2ED.', '', '', '', '', '', '18 Years (Statutory)', '', 'Suitable for Vegans\nSuitable for Vegetarians\nSuitable for Coeliacs\nSuitable for Sufferers of Lactose Intolerance', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:54', '2016-06-20 01:50:54', NULL),
(105, 105, 'AHIS002', 0, '2014-12-09', 'Off Licence', 'Sprits & Liqueurs', 'Gin', 'Brokers Gin', '', 'Created by Martin and Andy Dawson, two quintessentially English brothers, Broker''s channels the image of a bowler-hatted gentleman - an archetypal stockbroker - to reflect the fact that historically England is the home of Gin. Every bottle features a bowler hat; and the two brothers don''t leave home without one either.\nBroker''s Gin is made in a 200-year-old distillery in the heart of England using a traditional copper pot still, with the recipe as old as the distillery. A quadruple-distilled pure grain spirit made from English wheat is redistilled with ten traditional botanicals, creating a Gin of outstanding flavour and smoothness. Broker''s Gin does not follow the modern trend of using weird and wonderful spirits and botanicals - they believe our forefathers did an unbeatable job perfecting Gin recipes over many hundreds of years.\nBroker''s Gin has won more top awards in international competition over the last ten years than any other Gin including an impressive 97/100 at the 2010 Ultimate Spirits Challenge - the highest ever mark awarded to a Gin.', '', 'Premium London Dry Gin', 'Dial House,\nGovette Avenue,\nShepperton,\nSurrey,\nTW17 8AG.', 'Hi-Spirits Ltd,\n174 Terrace Road,\nWalton-on-Thames,\nKT12 2ED.', '', '', '', '', '', '18 Years (Statutory)', '', 'Kosher\nSuitable for Vegans\nSuitable for Vegetarians\nSuitable for Coeliacs\nSuitable for Sufferers of Lactose Intolerance', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:54', '2016-06-20 01:50:54', NULL),
