(122, 122, 'AGUI001', 0, '2015-01-30', 'Off Licence', 'Sprits & Liqueurs', 'Vodka', 'Ketel One', '', 'Handcrafted in small batches, using traditional recipes at the Nolet Distillery in Holland\n\nKetel One Vodka is the "Ultimate" in the world of vodka... in a class by itself', 'For ten generations, the Nolet family in Holland has been distilling the finest spirits using techniques and recipes perfected by Joannes Nolet and his successors since 1691. Ketel One, named after the original distilling kettle number one, is distilled in small batches using traditional pot stills, filtered through charcoal and rested until perfect. This costly, painstaking process yields a limited quantity of Ketel One Vodka that possesses a refined elegance, distinctive smoothness and unmatched quality.\n\nFrom Father to Son in Schiedam - Holland\nSince 1691\n1st Joannes Nolet 1638-1702\n2nd Jacobus Nolet 1682-1743\n3rd Joannes Nolet 1712-1772\n4th Joannes Nolet 1747-1835\n5th Jacobus Nolet 1773-1811\n6th Joannes Nolet 1801-1861\n7th Jacobus Nolet 1836-1906\n8th Joannes Nolet 1867-1934\n9th Paulus Nolet 1915-2001\n10th Carolus Nolet 1941 (Owner)', '', 'Nolet Distillery,\nHoofdstraat 14,\n3114 GG Schiedam,\nHolland.', 'Nolet Distillery,\nHoofdstraat 14,\n3114 GG Schiedam,\nHolland.\nwww.KetelOne.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '326', '74', '74', 'Gross Weight: 13', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:55', '2016-06-20 01:50:55', NULL),
