(127, 127, 'ABRE003', 0, '2015-03-18', 'Off Licence', 'Beer & Cider', 'Other Lager/Beer', 'Brew Dog', '', 'Welcome to a post Punk apocalyptic mother of an ale. A beer that spent its formative years Blitzkrieg Bopping around India and the sub-continent.\nThis light, golden classic has been subverted with new world hops to create a devastating explosion of flavour. Steel yourself for Kalashnikov bursts of caramel, incendiary tropical fruit and an all-out riot of grapefruit, pineapple and lychee, before a spiky bitter finish.\nThis is quintessential Empire with an anarchic twist. Turn up the volume. Pay the man. Embrace the punked up, pimped up Maharajah of Pale Ales. Nothing will ever be the same again.', 'At BrewDog we brew uncompromising, bold and irreverent beer. Beer with a soul and a purpose. It''s the only thing we know. It''s the only thing we want to know. We have a terminal craziness to make the beers we want to drink.\nOur approach is a modern day rebellion for flavour and choice. A mad last-ditch stand to create beer that actually tastes of something. Beer like it was. Beer like it will be.\nDitch the mainstream and say hello to BrewDog.', 'Punk IPA ', 'BrewDog plc,\nBalmacassie Commercial Park,\nEllon,\nAB41 8BX.', 'BrewDog plc,\nBalmacassie Commercial Park,\nEllon,\nAB41 8BX.\nwww.brewdog.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '229', '61', '61', 'Gross Weight: 55', 'Water,Barley,Hops,Yeast', '', 'Contains Barley', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:55', '2016-06-20 01:50:55', NULL),
(128, 128, 'ALSL001', 0, '2015-02-20', 'Grocery', 'Confectionery', 'Boxed Chocolate', 'Lindt', '', '', 'Do you dream in chocolate?\nThen discover Lindor and enjoy a moment that is yours: When you break Lindor''s delicate chocolate shell, the irresistibly smooth filling starts to melt, gently caressing all your senses and taking you to a place where chocolate dreams come true.\n\nLindor, created by Lindt''s Master Chocolatiers. Passion and love for chocolate since 1845.', 'Milk chocolate truffles with a smooth melting filling', 'Lindt & Sprüngli Spa,\nIT-21056 Induno,\nOlona (VA).', 'Quality Guarantee\nLindt & Sprüngli (UK) Ltd.,\n4 New Square,\nFeltham,\nMiddlesex,\nTW14 8HA.\nwww.lindt.com', '', '', '', '', '', '', '', '', '', '206', '137', '74', 'Gross Weight: 38', 'Sugar,Vegetable Fats (Coconut, Palm Kernel),Cocoa Butter,Cocoa Mass,Whole Milk Powder,Skimmed Milk Powder,Lactose,Anhydrous Milk Fat,Emulsifier (Soya Lecithin),Barley Malt Extract,Flavourings,Vanilla,Milk Chocolate contains - Cocoa solids: 31% minimum, Milk solids: 20% minimum', '', 'Contains Barley\nContains Milk\nMay Contain Almonds\nMay Contain Hazelnuts\nContains Soya', '', '', '', 'Per 100g:: Energy : 2574 kJ / 620 kcal, Fat : 48 g,  - Of which saturates : 34 g, Carbohydrate : 43 g,  - Of which sugars : 40 g, Protein : 4,9 g, Salt: 0,15 g', 'Per 100g/ml', '2574', '620', '48', '34', '43', '40', '4.9', '', '', '0.15', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:55', '2016-06-20 01:50:55', NULL),
