(153, 153, 'AWES001', 0, '2015-03-09', 'Off Licence', 'Sprits & Liqueurs', 'Cognac & Rum', 'Bacardi', '', 'BACARDI Carta Blanca is a light tasting and aromatic white rum with delicate floral and fruity notes, ideal for mixing. \n\nAppearance: Clear, polished, shimmering and bright, water white\n\nAroma/Nose: Impressions of light vanilla, (which serves to bring up the other flavours) and fresh apricot. Crisp woody herbs (lavender, thyme), flowers, subtle fresh fruits, soft nuts (ground almonds/marzipan), light banana\n\nTaste/Palate: Mild, soft, aromatic and delicate. Candied fruit, crystallised fruit, impressions of vanilla and apricot, sweet, creamy almond/marzipan flavours (almond croissant), Sweet fruity overtones, smooth and light.\n\nFinish: Dry, crisp and very clean finish, slightly sweet.', 'In 1862, Don Facundo Bacardi Masso, set out to create a rum like no other. He spent the next decade perfecting blends that he was proud to serve to the people of Cuba. He never settled, always looking for ways to improve his product.\n\nIn our new bottle designs we pay tribute to Don Facundo Bacardi Masso and the legacy of his rum; showcasing stories of the Bacardi family and history over 153 years, and celebrating the human craft and passion that still goes into every bottle today.\n\nNew Bottle. Same Relentless Passion.', 'Rum', '', 'Bacardi-Martini Ltd,\nWinchester,\nSO23 7TW.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:56', '2016-06-20 01:50:56', NULL),
