(173, 173, 'AKPS001', 0, '2015-09-03', 'Grocery', 'Crisps & Snacks', 'Single Pack Snacks', 'Hula Hoops', '', 'Our Promise to You...\nHula Hoops are cooked with 100% sunflower oil and are completely free from all artificial flavours, colours and MSG. Of course they still taste as great as ever!', 'Hula Hoops®\nBut a Hole lot Bigger!\n\nBig Hoops come in your favourite flavours...\nSalted, BBQ Beef, Cheese & Onion, Salt & Vinegar', 'Barbecue Beef Flavour Potato Rings', 'KP Snacks Limited,\nFreepost (LE6531),\nP.O. Box No. 4,\nAshby-de-la-Zouch,\nLeicestershire,\nLE65 1NZ.', 'Quality Guarantee\nPlease contact us on our Careline if you have any questions, comments or suggestions, or write to our Consumer Services Team, enclosing your pack and contents, stating when and where purchased.\nTel: Freephone (UK) 0800 526078 (Mon - Fri 9am - 5pm)\nRepublic of Ireland 1800 620415\nMail:\nKP Snacks Limited,\nFreepost (LE6531),\nP.O. Box No. 4,\nAshby-de-la-Zouch,\nLeicestershire,\nLE65 1NZ.\nEmail via: www.kpsnacks.com', '', '', '', '', '', '', '', 'Suitable for Vegetarians', '', '215', '130', '41', 'Gross Weight: 10', 'Potato (Dried Potato & Potato Starch),Sunflower Oil (26%),Barbecue Beef Flavour [Rice Flour, Salt, Dried Yeast Extract, Dried Whey (Milk), Dried Onion, Potassium Chloride, Natural Flavourings, Sugar, Maltodextrin, Dried Tomato, Colour: Paprika Extract],Natural Flavouring (contains Potassium Chloride, Salt, Maltodextrin, Dried Onion, Dried Yeast Extract),Salt', '', 'May Contain Gluten\nContains Milk', '', '', 'Free From MSG (Glutamate)\nFree From Artificial Colours\nFree From Artificial Flavours', 'Per 100g: Energy : 2139kJ, : 511kcal, Fat : 26g, of which Saturates : 2.5g, Carbohydrate : 64g, of which Sugars : 1.3g, Fibre : 2.4g, Protein : 3.3g, Salt : 1.8g, 96g pack = approximately 4 servings: \nPer 24g Serving: Energy : 513kJ, : 123kcal, Fat : 6.2g, of which Saturates : 0.6g, Carbohydrate : 15g, of which Sugars : <0.5g, Fibre : 0.6g, Protein : 0.8g, Salt : 0.43g