(192, 192, 'AEDW001', 0, '2015-06-16', 'Off Licence', 'Sprits & Liqueurs', 'Cognac & Rum', 'Bacardi', '', 'Bacardí Carta Blanca is a light tasting and aromatic white rum with delicate floral and fruity notes, ideal for mixing. As this rum neither dominates nor disappears, it mixes well with all sodas and fresh juices, as well as your favourite cola.\n\nBacardí Carta Blanca has been blended by Maestros de Ron Bacardí. This rum has light vanilla notes, developed in oak barrels, and is perfect for mixing.', 'El Coco The Legendary Palm\nPlanted at the first Bacardí distillery in Cuba in 1862, El Coco survived wars, earthquakes and a distillery fire. We now plant a palm at all of our facilities as a reminder of our homeland.', 'Carta Blanca Superior White Rum', 'Bacardi España S.A.,\nCalle Velázquez,\n51, 28001,\nMadrid (España).', 'Bacardi España S.A.,\nCalle Velázquez,\n51, 28001,\nMadrid (España).', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '308', '74', '74', 'Gross Weight: 11', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:58', '2016-06-20 01:50:58', NULL),
