(199, 199, 'ACOC001', 0, '2015-06-09', 'Drinks', 'Carbonated Drinks', 'Other Flavoured Carbonated Drinks', 'Fanta', '', 'Bright, bubbly, instantly refreshing and great tasting. Fanta Orange is made with 100% natural flavours, 5% Juice and is caffeine free.\n\nFanta''s cool taste is made with…\n\nReal fruit\nNatural flavours \nNo artificial colours\nSugar and sweeteners\n\nServe ice cold for maximum refreshment.\n\nContains 6 X 250ml servings.\n\nKeep cold in the fridge.\n\nPlease recycle.', 'Coca-Cola and the Environment\nCoca-Cola is committed to making a positive difference - to the health of the planet, consumers and the communities it serves. The company is working hard to reduce its impact on the environment in everything it does - growing more while using less in areas such as energy and water use, waste reduction and recycling - and by encouraging people to think more about the positive impact they can have on their local environment.', 'Sparkling orange fruit drink with sugar and sweeteners', 'Coca-Cola Enterprises Ltd,\nUxbridge,\nUB8 1EZ.', 'Coca-Cola Enterprises Ltd,\nUxbridge,\nUB8 1EZ.\nFreephone Consumer Careline\n0800 227711\nwww.fanta.com', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Carbonated Water,Sugar,Orange Fruit from Concentrate (5%),Citric Acid,Vegetable Concentrates (Carrot and Pumpkin),Natural Orange Flavourings with other Natural Flavourings,Preservative (Potassium Sorbate),Malic Acid,Acidity Regulator (Sodium Citrate),Sweeteners (Acesulfame-K, Aspartame),Antioxidant (Ascorbic Acid),Stabiliser (Guar Gum)', '', '', '', '', '', 'Per: 100ml: Energy:: 121kJ/, : 29kcal, Fat:: 0g,  of which saturates:: 0g, Carbohydrate:: 6.9g,  of which sugars:: 6.9g, Protein:: 0g, Salt:: 0g, *Reference intake of an average adult (8400kJ/2000kcal)  : \nPer: 250ml (%*): Energy:: 303kJ/, : 73kcal (4%), Fat:: 0g (0%),  of which saturates:: 0g (0%), Carbohydrate:: 17g (7%),  of which sugars:: 17g (19%), Protein:: 0g (0%), Salt:: 0g (0%), *Reference intake o