(200, 200, 'ATOO001', 0, '2015-06-22', 'Off Licence', 'Sprits & Liqueurs', 'Gin', 'Sloane''s', '', 'Sloane''s premium dry gin is an exceptionally smooth, premium quality award-winning gin made in small batches from individually distilled botanicals and fresh citrus fruits.\nUnlike other gins, Sloane''s premium dry gin is meticulously crafted together by our master distiller and blender to create the perfect tasting gin.\nAt Toorank, we believe that Sloane''s premium dry gin is the world''s finest gin born of a master distiller''s skill with a taste and quality unmatched by any other.\nAnd it would appear that many expert palates the world over would agree. In addition to being awarded a silver medal & ''Best in Class'' at the IWSC 2010, it was recently voted World''s best gin, best white spirit and awarded a double gold medal at the prestigious San Francisco world spirits competition 2011', 'Individually Distilled\nSloanes Gin is made in small batches and unlike other gins, each botanical is distilled individually having been steeped in liquor for 24 hours. After the distillation there is a further period of ''rest'' for a minimum of one month. The distiller is then able to ''marry'' the distilled botanicals to make the perfect premium gin.', 'Premium Distilled Dry Gin Original', 'Distilled & bottled by:\nToorank Distilleries,\nPO-Box 337,\n6900 AH,\nZevenaar,\nThe Netherlands.', 'www.sloanes-gin.com', '', '', '', '', '', '18 Years (Statutory)', 'Packing - Recyclable ', '', '', '244', '93', '84', 'Gross Weight: 12', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:58', '2016-06-20 01:50:58', NULL),
