(202, 202, 'ASCB003', 0, '2015-09-07', 'Off Licence', 'Beer & Cider', 'Cider', 'Bulmers', '', 'Like our famous founders, Henry and Percy, Bulmers continues to innovate with new varieties and flavours. Discover Bulmers Cider Crushed Red Berries & Lime to experience an explosive fruit blend. \n\nAt 4% ABV, Bulmers Cider Crushed Red Berries & lime is a full flavoured mixed red berry cider, cut through with a sharp shot of lime to deliver an explosive fruit taste. \n\nBulmers Cider Crushed Red Berries & Lime compliments the colourful Bulmers range offering a flavour for everyone, perfect for mixed group drinking occasions. Serve over ice with a wedge of lime for maximum refreshment. ', '', 'Cider with red berries and lime', 'HP Bulmer Ltd.,\nHereford,\nHR4 0LE.', 'HP Bulmer Ltd.,\nHereford,\nHR4 0LE.\nwww.bulmers.co.uk\nConsumer Careline 0845 303 0351\ncustomerservices@bulmers.co.uk', '', '', '', '', '', '18 Years (Statutory)', 'Carton - Card - Widely Recycled ', '', '', '134', '335', '118', 'Gross Weight: 36', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:58', '2016-06-20 01:50:58', NULL),
