(225, 225, 'ASCB003', 0, '2015-09-07', 'Off Licence', 'Beer & Cider', 'Cider', 'Bulmers', '', 'With over 125 years of cider making expertise Bulmers Pear Cider delivers a refreshing, juicy pear taste. Serve chilled over ice for maximum refreshment.\n\nA medium 4.5% ABV pear cider made mainly from desert pears with a hint of perry pear & apple juice for extra depth and body.\n\nBulmers Pear Cider compliments the colourful Bulmers range, offering a flavour for everyone, perfect for mixed group drinking occasions.', '', 'Premium Quality Cider', 'HP Bulmer Ltd.,\nHereford,\nHR4 0LE.', 'HP Bulmer Ltd.,\nHereford,\nHR4 0LE.\nEmail: friends@bulmers.co.uk\nConsumer Careline 0845 303 0351\ncustomerservices@bulmers.co.uk', '', '', '', '', '', '18 Years (Statutory)', 'Bottle - Glass - Widely Recycled ', '', '', '251', '75', '75', 'Gross Weight: 92', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:59', '2016-06-20 01:50:59', NULL),
