(227, 227, 'ASCB003', 0, '2015-10-28', 'Off Licence', 'Beer & Cider', 'Cider', 'Scrumpy Jack', '', 'Founded in 1727 Scrumpy Jack is the brand that carries the generic name for farmhouse cider. Scrumpy Jack appeals to the drinker who enjoys a refreshing drink with flavour and strength, similar to the real ale drinker. The taste of the English countryside, made entirely from locally grown bitter-sweet cider apples, including Dabinett and Chisel Jersey, creating a premium cider with a natural fruity aroma and superior crisp taste.', '', 'Premium English cider', 'Symonds,\nHereford,\nHR4 OLE.', 'Symonds,\nHereford,\nHR4 OLE.\nconsumercare@bulmers.com\n0845 303 0351', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:59', '2016-06-20 01:50:59', NULL),
