(230, 230, 'AFGL001', 0, '2015-07-09', 'Off Licence', 'White Wine', 'Australian', 'Lindeman''s', '', 'This soft smooth Chardonnay with its delightful melon and peach flavours is one of the best-value wines available.\n\nInternationally recognised as one of the best value-for-money wines around the world and renowned for consistency and quality. If you enjoy this style of wine you will love Bin 50 Shiraz & Bin 40 Merlot.', 'The story of Lindemans started in 1843. That was the year Dr. Henry Lindeman planted his first vines in the Hunter Valley. Lindemans has continued to consistently create award-winning wines, making it one of the most respected and enduring winemakers The fruits from this wine are sourced from the best parcels of fruit each vintage, from a wide array of premium growing areas throughout the southern states of Australia. The fruit is ripe and shows good Chardonnay varietal character.  Parcels of this wine were matured with seasoned French and American oak. "Superb intensity of flavour and a totally ‘honest'' palate, there is seriously clever oak integration here.  Superb - my favourite Bin 65 ever." Matthew Jukes - May 2008.', 'Chardonnay - White Australian Wine', 'Produced and Bottled by:\nLindemans Wines,\nEdey Road,\nKaradoc,\nAustralia 3496.', 'Comments:\nAttention Customer Relations Manager\nLindemans Wines,\n15 Church Street,\nTwickenham,\nMiddlesex,\nTW1 3NL,\nUK.\nwww.lindemans.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:59', '2016-06-20 01:50:59', NULL),
