(235, 235, 'ASIP001', 0, '2015-07-08', 'Off Licence', 'Sprits & Liqueurs', 'Gin', 'Sipsmith', '', 'London Dry Gin \nOur pride and joy, this gin is the marriage of a classic recipe and a truly traditional handcraft process - London Dry Gin made the way it used to be, the way it should be.\n\nTo build the perfect G&T fill a tall glass with ice, add 50ml of Sipsmith London Dry Gin (the gin cools as it runs over the ice), top with a chilled good quality tonic (like Fever-Tree) and garnish with a fresh wedge of unsqueezed lime.', 'The Sipsmith Distillery\nHaving launched the first copper distillery in London since 1820, we''re on a mission to bring gin of uncompromising quality and character back to the city where it earned its name.\n\nSipsmith? Why ''Sipsmith?'' Well, much the same way wordsmiths love to create all things wordical, we love to create all things sippical. Like gin.\n\nAs passionate purveyors of our craft we''d love nothing more than to raise a G&T with you on a tour of the Sipsmith Distillery.\n\nIn 2009 we set up London''s first copper distillery for 189 years, crafting all our award-winning spirits by hand in small batches. ', 'London Dry Gin', 'Distilled by:\nSipsmith,\n83 Cranbrook Road,\nLondon,\nW4 2LJ.', 'Sipsmith,\n83 Cranbrook Road,\nLondon,\nW4 2LJ.\nwww.sipsmith.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '256', '88', '88', 'Gross Weight: 14', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:59', '2016-06-20 01:50:59', NULL),
(236, 236, 'ASIP001', 0, '2015-07-08', 'Off Licence', 'Sprits & Liqueurs', 'Gin', 'Sipsmith', '', 'Handcrafted in the first copper distillery to launch in London since 1820, this is London Dry gin made the way it used to be - the way is should be.\n\nDistilled with signature Sipsmithian skill, care and an almost fetishtistical love, the result is a quintessential classic expression of its style; stunningly smooth, full of character, and exploding with flavour.\n\nSipsmith: where old meets new and the two hit it off really quite spectacularly.', 'Sipsmith? Why ''Sipsmith?'' Well, much the same way wordsmiths like to craft all things wordical, we craft all things sippical. Like gin.', 'London Dry Gin', 'Distilled by:\nSipsmith,\n83 Cranbrook Road,\nLondon,\nW4 2LJ.', 'Sipsmith,\n83 Cranbrook Road,\nLondon,\nW4 2LJ.\nwww.sipsmith.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '202', '70', '70', 'Gross Weight: 75', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:50:59', '2016-06-20 01:50:59', NULL),
