(246, 246, 'ACOC001', 0, '2015-07-20', 'Drinks', 'Carbonated Drinks', 'Other Flavoured Carbonated Drinks', 'Dr Pepper', '', 'What''s the Worst that can happen? Dr Pepper''s unique, sparkling blend of 23 fruit and spice flavours has been around for well over a century and it''s still the same, with that distinctive flavour you just can''t quite put your tongue on.\n\nSparkling Fruit Flavour Soft Drink\n\nServe cold for maximum refreshment. \n\nStore in a cool and dry place\n\nPlease recycle. ', 'Coca-Cola and the Environment\nCoca-Cola is committed to making a positive difference - to the health of the planet, consumers and the communities it serves. The company is working hard to reduce its impact on the environment in everything it does - growing more while using less in areas such as energy and water use, waste reduction and recycling - and by encouraging people to think more about the positive impact they can have on their local environment.', 'Sparkling Fruit Flavour Soft Drink with Sugar and Sweeteners', 'Coca-Cola Enterprises Ltd,\nUxbridge,\nUB8 1EZ.', 'Coca-Cola Enterprises Ltd,\nUxbridge,\nUB8 1EZ.\n0800 227711\nCoca-Cola.co.uk', '', '', '', '', '', '', 'Bottle - Plastic - Widely Recycled ', 'Suitable for Vegans\nSuitable for Vegetarians', 'Contains Caffeine', '', '', '', '', 'Carbonated Water,Sugar,Colour (Caramel E150d),Phosphoric Acid,Preservative (Potassium Sorbate),Flavourings Including Caffeine,Sweeteners (Aspartame, Acesulfame K)', '', 'Free From Celery\nFree From Cereals Containing Gluten\nFree From Crustaceans\nFree From Eggs\nFree From Fish\nFree From Lupin\nFree From Milk\nFree From Molluscs\nFree From Mustard\nFree From Nuts\nFree From Peanuts\nFree From Sulphur Dioxide/Sulphites\nFree From Soya\nFree From Sesame', '', '', 'Free From Genetically Modified Ingredients', 'Per 100ml: Energy : 123kJ, : 29kcal, Fat : 0g, Of which saturates : 0g, Carbohydrate : 7.2g, Of which sugars : 7.2g, Protein : 0g, Salt : 0g, *Reference intake of an average adult