(264, 264, 'ASCB001', 0, '2015-09-07', 'Off Licence', 'Beer & Cider', 'Other Lager/Beer', 'Birra Moretti', '', 'To produce Birra Moretti, only the highest quality raw materials are used and a particular mixture of valuable hops give the beer its unique aroma, intensifying the pleasant slight bitter flavour. ABV 4.6%.', 'Birra Moretti was first created in Udine, Italy in 1859 by Luigi Moretti in his Ice and Beer factory and is still brewed to this recipe today. Birra Moretti is an authentic Italian beer, brewed with quality natural ingredients to produce a distinctive golden beer which is a perfect accompaniment with food or to be enjoyed on its own. Birra Moretti is now exported to more than 30 countries worldwide. ', 'Beer', 'Heineken Italia S.p.A.,\nViale Edison,\n110 Sesto S. Giovanni,\nItaly.', 'Heineken Italia S.p.A.,\nViale Edison,\n110 Sesto S. Giovanni,\nItaly.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '272', '75', '75', 'Gross Weight: 98', 'Water,Malted Barley,Maize,Hops', '', 'Contains Barley', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:01', '2016-06-20 01:51:01', NULL),
