(295, 295, 'AWBC001', 0, '2015-10-23', 'Off Licence', 'Beer & Cider', 'Other Lager/Beer', 'Stella Artois', '', 'Most lager and pilsner beers are made of the same ingredients. But that doesn''t mean they''re all created equal. Every Stella Artois is brewed with water, malted barley and maize. But most importantly, Saaz Hops.  It''s what helps Stella Artois stand out.\nSaaz, the origins of which can be traced back 1,000 years, is known as one of the noble hops: the original hops grown in central Europe.\nIn Stella Artois, it gives a delicate green hoppy note that harmonizes with the fruity aroma coming from fermentation.\nThe key to brewing a great beer is having the best ingredients to choose from.\nAnd Saaz Hops are key to making Stella Artois the flavourful lager it is today.', 'Originally crafted as a Christmas gift for the Belgian town of Leuven, ''Stella'' Artois was so well received, the brewery named it after a star, and decided to give it to the world forever.', '', 'AB Inbev UK Limited,\nLU1 3LS.', 'AB Inbev UK Limited,\nLU1 3LS.\nConsumer Helpline: 0870 24 111 24\nwww.stellaartois.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:02', '2016-06-20 01:51:02', NULL),
(296, 296, 'AWBC001', 0, '2015-10-23', 'Off Licence', 'Beer & Cider', 'Other Lager/Beer', 'Stella Artois', '', 'Most lager and pilsner beers are made of the same ingredients. But that doesn''t mean they''re all created equal. Every Stella Artois is brewed with water, malted barley and maize. But most importantly, Saaz Hops.  It''s what helps Stella Artois stand out.\nSaaz, the origins of which can be traced back 1,000 years, is known as one of the noble hops: the original hops grown in central Europe.\nIn Stella Artois, it gives a delicate green hoppy note that harmonizes with the fruity aroma coming from fermentation.\nThe key to brewing a great beer is having the best ingredients to choose from.\nAnd Saaz Hops are key to making Stella Artois the flavourful lager it is today.', 'Originally crafted as a Christmas gift for the Belgian town of Leuven, ''Stella'' Artois was so well received, the brewery named it after a star, and decided to give it to the world forever.', 'Triple filtered smooth lager', '', 'AB Inbev UK Limited,\nLU1 3LS.\nConsumer Helpline: 0870 24 11124\nwww.stellaartois.com', '', '', '', '', '', '18 Years (Statutory)', 'Sleeve - Card - Widely Recycled ', '', '', '153', '264', '137', 'Gross Weight: 37', 'Water,Malted Barley,Maize,Hops', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:03', '2016-06-20 01:51:03', NULL),
(297, 297, 'AWBC001', 0, '2015-10-23', 'Off Licence', 'Beer & Cider', 'Other Lager/Beer', 'Beck''s', '', 'Golden in color, Beck''s is a classic German-style pilsner with a robust, distinctive full-bodied taste, a fresh “hoppy” bouquet, distinct bitterness and a rich, full head.', 'Over 140 years of heritage, independent, quirky and progressive - Beck''s is a pilsner style lager originally brewed in Germany according to Reinheitsgebot (German purity law).', 'Beer', 'Brewed and Bottled by:\nBrauerei Beck GmbH & Co KG,\nBremen,\nGermany.', 'Consumer Helpline: 0870 24 111 24\nAB Inbev UK Limited,\nLuton,\nLU1 3LS.\nbecks.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '216', '171', '115', 'Gross Weight: 27', 'Water,Malted Barley,Hops,Yeast', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:03', '2016-06-20 01:51:03', NULL),
(298, 298, 'AWBC001', 0, '2015-10-23', 'Off Licence', 'Beer & Cider', 'Other Lager/Beer', 'Budweiser', '', 'This is the famous Budweiser beer. We know of no brand produced by any other brewer which costs so much to brew and age. Our exclusive Beechwood Aging produces a taste, a smoothness and a drinkability you will find in no other beer at any price.', 'Known as "The King of Beers," Budweiser was first introduced by Adolphus Busch in 1876 and it''s still brewed with the same high standards today. Budweiser is a medium-bodied, flavorful, crisp American-style lager. Brewed with the best barley malt and a blend of premium hop varieties, it is an icon of core American values like optimism and celebration.', 'Beer', 'Brewed by:\nAB Inbev UK Limited,\nLU1 3LS.', 'AB Inbev UK Limited,\nLU1 3LS.\nConsumer Helpline: 0870 24 111 24', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '189', '132', '132', 'Gross Weight: 23', '', '', 'Contains Barley', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:03', '2016-06-20 01:51:03', NULL),
