(301, 301, 'AWBC001', 0, '2015-10-23', 'Off Licence', 'Beer & Cider', 'Lager Bottles', 'Leffe', '', 'Age-old expertise and the combination of pale malt, water, hop and yeast lend Leffe Blond its subtle taste and golden colour, which manages to catch and reflect the light. Hints of vanilla and clove infuse the beer with an even smoother flavour, which best expresses itself in a Leffe chalice, simultaneously allowing the soft, fresh essence of this beer to unveil its true elegance. ', 'Leffe is an authentic Belgian Abbey beer, founded by the Fathers of the Abbey in 1240 and their craft, expertise and brewing tradition can still be enjoyed today. This brewing heritage is now shared and enjoyed by consumers in over 60 countries worldwide.', 'Beer', 'Brewed for:\nBr. Abbaye de Leffe s.a./n.v.,\nPlace de l''Abbaye 1,\nB-5500 Dinant.', 'Br. Abbaye de Leffe s.a./n.v.,\nPlace de l''Abbaye 1,\nB-5500 Dinant.', '', '', '', '', '', '18 Years (Statutory)', 'Packing - Recyclable ', '', '', '230', '61', '61', 'Gross Weight: 53', '', '', 'Contains Barley', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:03', '2016-06-20 01:51:03', NULL),
