(303, 303, 'ACOC001', 0, '2015-10-13', 'Drinks', 'Carbonated Drinks', 'Other Flavoured Carbonated Drinks', 'Relentless', '', 'Where it started. Our classic, refreshing, great tasting energy drink, formulated to support those who are committed to chasing down their goals with passion and energy.\n\nRelentless is an energy drink that helps give you the stamina, focus and drive you need, when you need it.\nHigh caffeine Content\n\nServe cold for maximum refreshment.\n\nStore in a cool and dry place\n\nPlease recycle.', 'Coca-Cola and the Environment\nCoca-Cola is committed to making a positive difference - to the health of the planet, consumers and the communities it serves. The company is working hard to reduce its impact on the environment in everything it does - growing more while using less in areas such as energy and water use, waste reduction and recycling - and by encouraging people to think more about the positive impact they can have on their local environment.', 'Sparkling Mixed Fruit Flavour Energy Drink with Caffeine', 'Coca-Cola Enterprises Ltd.,\nUxbridge,\nUB8 1EZ.', 'Coca-Cola Enterprises Ltd.,\nUxbridge,\nUB8 1EZ.\n0800 227711\nwww.relentlesenergy.com', '', '', '', '', '', '', 'Can - Metal - Widely Recycled ', '', '', '134', '53', '53', 'Gross Weight: 27', 'Carbonated Water,Sugar,Citric Acid,Taurine,Acidity Regulator (Sodium Citrate),Preservatives (Potassium Sorbate, Sodium Benzoate),Colour (Caramel E150d),Flavourings,Caffeine,Vitamins (Niacin, Pantothenic Acid, B6, B12),Guarana', '', '', '', '', '', 'Per: 100ml: Energy:: 190kJ/, : 45kcal, Fat:: 0g,  of which saturates:: 0g, Carbohydrate:: 10.6g,  of which sugars:: 10.6g, Protein:: 0g, Salt:: 0.13g, Vitamins: , Niacin (Vitamin B3):: 3.2mg (20%**), Pantothenic Acid:: 1.2mg (20%**), Vitamin B6:: 0.28mg (20%**), Vitamin B12:: 0.5µg (20%**), *Reference intake of an average adult (8400kJ/2000kcal): , **Nutrient Reference Value: \nPer: 250ml (%*): Energy:: 475kJ/, : 113kcal (6%), Fat:: 0g (0%),  of which sat