(304, 304, 'APRB001', 0, '2015-10-20', 'Off Licence', 'Sprits & Liqueurs', 'Gin', 'Plymouth', '', 'Plymouth Gin is synonymous with the spirit of discovery & is recognised as the gin of choice for many gin enthusiasts and bartenders around the globe. This historical gin, renowned for its superior quality, has been distilled on the same site since 1793 at The Black Friar''s Distillery located a short distance from Plymouth Harbour; a famous departure point for Britain''s most renowned explorers.\n\nPlymouth is ideal served with tonic over ice and a squeeze of lemon or lime. Alternatively savour its smooth taste in, amongst other wonderful cocktails.\n\nDouble Gold - San Francisco World Spirits Competition ( SFWSC) 2015\nGold - International Spirts Competition (ISC) 2015', '', 'Gin', 'Black Friars Distillery,\nPlymouth,\nPL1 2LQ,\nEngland. ', 'Black Friars Distillery,\nPlymouth,\nPL1 2LQ,\nEngland. \nwww.plymouthgin.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '242', '104', '75', 'Gross Weight: 13', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:03', '2016-06-20 01:51:03', NULL),
(305, 305, 'APRB001', 0, '2015-10-20', 'Off Licence', 'Sprits & Liqueurs', 'Cognac & Rum', 'Martell', '', 'Martell has been producing fine cognac since 1715. In 2015 we will be celebrating The House''s 300 year anniversary.\n\nMartell VS Fine Cognac is produced from the most prestigious crus of the Cognac region, selected by the cellar master and aged in French oak barrels. Martell VS has rich fruit and spice notes framed by citrus and fresh pear. Its harmonious, finely balanced blend makes it the ideal cognac for long drinks and cocktails.', '', 'Cognac', 'Martell & Co,\n14100,\nCognac,\nFrance.', 'Ukconsumerfeedback@pernod-ricard.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:03', '2016-06-20 01:51:03', NULL),
