(308, 308, 'APRB001', 0, '2015-10-20', 'Off Licence', 'Sprits & Liqueurs', 'Cognac & Rum', 'Havana Club', '', 'The natural ageing process in young oak barrels in Cuba for a number of years gives Havana Club Añejo Especial its warm amber colour and smooth taste. Aged in this way, it develops a typical touch of vanilla that is perfect for mixing with cola or just with ice. The best way to savour this special rum is in typical Cuban style - together with your best friends.', 'All Havana Club rums are made and aged in Cuba, by our maestros roneros, following the Cuban light rum making tradition.  The name "Havana Club" captures Cuba''s rum-making heritage and the unique atmosphere of Havana, the country''s capital. Havana Club is closely entwined with Cuban culture, and Cubans take pride in what has become a true national icon.', 'Traditional Rum', '', 'UK: Pernod Ricard UK,\nChiswick Park,\nLondon,\nW4 5AN.\n\nIreland: Irish Distillers Ltd.,\nSimmonscourt Hse.,\nSimmonscourt Rd.,\nBallsbridge,\nDublin.\nIf you wish to make any comments, please write to the above address.\nFor more information, see www.drinkaware.ie', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '303', '75', '75', 'Gross Weight: 12', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:03', '2016-06-20 01:51:03', NULL),
