(321, 321, 'ARED004', 0, '2015-10-26', 'Drinks', 'Carbonated Drinks', 'Canned Carbonated Drinks', 'Red Bull', '', 'Red Bull Sugarfree, 250ml can, sugar free variant\n\nRed Bull Sugarfree is Red Bull Energy Drink without sugar. It is a functional beverage with only 3 calories per 100 ml.\n\nNo Sugar. 100% Wings\n\nRed Bull Sugarfree gives you wings while balancing a busy day between work and gym or during fun nights out with your friends. Whenever you are in need of a boost.\n\nIt is perfect when you are on the road, during lectures and study sessions, at work, whilst doing sports, playing video games or going out day and night.\n\nThis forms part of Red Bull''s energy drinks range', '', 'Caffeinated taurine drink with sweeteners.', 'Red Bull Company Limited,\n155-171 Tooley Street,\nSE1 2JP,\nLondon,\nUnited Kingdom.', 'Red Bull Company Limited,\n155-171 Tooley Street,\nSE1 2JP,\nLondon,\nUnited Kingdom.\nwww.redbull.co.uk\n\nRichmond Marketing,\n1st floor Harmony Row,\nDublin 2,\nIreland.\nwww.redbull.ie', '', '', '', '', '', '', 'Packing - Recyclable ', '', '', '135', '53', '53', 'Gross Weight: 26', 'Water,Acidifier Citric Acid,Carbon Dioxide,Taurine (0.4%),Acidity Regulator (Sodium Carbonates, Magnesium Carbonate),Sweeteners (Acesulfame K, Aspartame),Caffeine (0.03%),Vitamins (Niacin, Pantothenic Acid, B6, B12),Flavourings,Thickener Xanthan Gum,Colours (Caramel, Riboflavin)', '', '', '', '', '', 'per 100 ml: Energy : 13kJ (3kcal), Fat : 0 g,  of which Saturates : 0 g, Carbohydrates: 0 g,  of which Sugars : 0 g, Protein : 0 g, Salt : 0.1 g, Vitamins:: , Niacin : 8 mg / 50% NRV, Pantothenic Acid : 2 mg / 33% NRV, Vitamin B6: 2 mg / 143% NRV, Vitamin B12 : 2 µg / 80% NRV, NRV = Nutrient Reference Value: ', 'Per 100g/ml', '13', '3', '0', '0', '0', '0', '0', '', '', '0.1', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:04', '2016-06-20 01:51:04', NULL),
(322, 322, 'AWBC001', 0, '2015-10-23', 'Off Licence', 'Beer & Cider', 'Other Lager/Beer', 'Budweiser', '', 'This is the famous Budweiser beer. We know of no brand produced by any other brewer which costs so much to brew and age. Our exclusive Beechwood Aging produces a taste, a smoothness and a drinkability you will find in no other beer at any price.', 'Known as "The King of Beers," Budweiser was first introduced by Adolphus Busch in 1876 and it''s still brewed with the same high standards today. Budweiser is a medium-bodied, flavorful, crisp American-style lager. Brewed with the best barley malt and a blend of premium hop varieties, it is an icon of core American values like optimism and celebration.', 'Beer', 'Brewed by:\nAB Inbev UK Limited,\nLU1 3LS.', 'AB Inbev UK Limited,\nLU1 3LS.\nConsumer Helpline: 0870 24 111 24', '', '', '', '', '', '18 Years (Statutory)', 'Packing - Recyclable ', '', '', '170', '133', '133', 'Gross Weight: 20', '', '', 'Contains Barley', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:04', '2016-06-20 01:51:04', NULL),
