(338, 338, 'ADEL004', 0, '2015-11-23', 'Off Licence', 'White Wine', 'New Zealand', 'Oyster Bay', '', 'Enticing tropical flavours, scented with fragrant passionfruit and a zesty freshness.\n\nPale straw green in colour with brilliant clarity, Oyster Bay Marlborough Sauvignon Blanc is zesty and aromatic with lots of lively, penetrating fruit characters. A concentration of tropical and gooseberry flavours with an abundant bouquet, it is a wine that is always crisp, elegant and refreshing. \n\nMarlborough is New Zealand''s largest and most renowned wine growing region. Characterised by a temperate, maritime climate, it produces intense, aromatic wines with trademark acidity.', 'The philosophy of Oyster Bay is to produce fine, distinctly regional Super Premium wines that are elegant and assertive, with glorious fruit flavours.', 'Sauvignon Blanc - White New Zealander Wine', 'Produced and bottled by:\nOyster Bay Wines New Zealand Ltd.,\n13 Alfred Street,\nBlenheim,\nMarlborough,\nNew Zealand.', 'Delegat Europe Ltd.,\n4th Floor, Kenilworth House,\n79-80 Margaret Street,\nLondon,\nW1W 8TA,\nUnited Kingdom.\noysterbaywines.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '300', '81', '81', 'Gross Weight: 12', '', '', 'Contains Eggs\nContains Milk\nContains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:04', '2016-06-20 01:51:04', NULL),
