(341, 341, 'ACOC001', 0, '2015-11-10', 'Drinks', 'Carbonated Drinks', 'Cola', 'Coca-Cola', '', 'Did you know every time you open a bottle of Coca-Cola 12,607 bubbles are born? Happy Birthday bubbles!\n\nGreat Coke taste\nOnly natural flavours\nNo added preservatives\nGluten-free, dairy-free and nut-free\n\nServe ice cold for maximum refreshment.\n\nKeep one cold in the fridge.\n\nPlease recycle', 'Coca-Cola and the Environment Coca-Cola is committed to making a positive difference - to the health of the planet, consumers and the communities it serves. The company is working hard to reduce its impact on the environment in everything it does - growing more while using less in areas such as energy and water use, waste reduction and recycling - and by encouraging people to think more about the positive impact they can have on their local environment.', 'Sparkling Soft Drink with Vegetable Extracts', 'Coca-Cola Enterprises Ltd,\nUxbridge,\nUB8 1EZ.', 'Coca-Cola Enterprises Ltd,\nUxbridge,\nUB8 1EZ.\n0800 227711\nCoca-Cola.co.uk', '', '', '', '', '', '', 'Film - Recycle with carrier bags at larger stores - Not at Kerbside ', '', '', '133', '133', '116', 'Gross Weight: 14', 'Carbonated Water,Sugar,Colour (Caramel E150d),Phosphoric Acid,Natural Flavourings Including Caffeine', '', '', '', '', '', 'Per: 100ml: Energy:: 180kJ/, : 42kcal, Fat:: 0g,  of which saturates:: 0g, Carbohydrate:: 10.6g,  of which sugars:: 10.6g, Protein:: 0g, Salt:: 0g, *Reference intake of an average adult (8400kJ/2000kcal): \nPer: 330ml (%*): Energy:: 594kJ/, : 139kcal (7%), Fat:: 0g (0%),  of which saturates:: 0g (0%), Carbohydrate:: 35g (13%),  of which sugars:: 35g (39%), Protein:: 0g (0%), Salt:: 0g (0%), *Reference intake of an average adult (8400kJ/2000kcal): ', 'Per 100g/ml', '180', '42', '0', '0', '10.6', '10.6', '0', '', '', '0', '', 'Per: 330ml', '594', '139', '0', '0', '35', '35', '0', '', '', '0', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:05', '2016-06-20 01:5