(342, 342, 'ACAD001', 0, '2015-11-19', 'Grocery', 'Confectionery', 'Single Chocolate Bars', 'Cadbury', '', '', '', 'The crumbliest, flakiest milk chocolate.', 'Mondelez UK,\nPO Box 7008,\nBirmingham,\nB30 2PT.\n\nMondelez Ireland,\nMalahide Road,\nCoolock,\nDublin 5.', 'We are passionate about our great quality Cadbury products. Not completely satisfied? Please contact us:\nFreephone 0800 818181 (UK only)\nMondelez UK,\nPO Box 7008,\nBirmingham,\nB30 2PT.\n\nMondelez Ireland,\nFreephone 1-800 678708\nMalahide Road,\nCoolock,\nDublin 5.\nwww.cadbury.co.uk', '', '', '', '', '', '', '', 'Suitable for Vegetarians', '', '20', '152', '21', 'Gross Weight: 33', 'Milk,Sugar,Cocoa Butter,Cocoa Mass,Vegetable Fats (Palm, Shea),Emulsifier (E442),Flavourings,Milk Solids 14% minimum,Cocoa Solids 25% minimum,Contains Vegetable Fats in addition to Cocoa Butter', '', 'Contains Milk', '', '', '', 'Per 100g: Energy : 2230 kJ/535 kcal, Fat : 30.5g,  of which Saturates : 19g, Carbohydrate : 56g,  of which Sugars : 55.5g, Fibre : 0.7g, Protein : 8.1g, Salt : 0.28g, *Reference intake of an average adult (8400 kJ/2000 kcal): \nPer Bar (32g): Energy : 713 kJ/171 kcal, Fat : 9.8g,  of which Saturates : 6.1g, Carbohydrate : 18g,  of which Sugars : 18g, Fibre : 0.2g, Protein : 2.6g, Salt : 0.09g, *Reference intake of an average adult (8400 kJ/2000 kcal): \n*Reference Intakes: Energy : 8400 kJ/2000 kcal, Fat : 70g,  of which Saturates : 20g, Carbohydrate : 260g,  of which Sugars : 90g, Fibre : -, Protein : 50g, Salt : 6g, *Reference intake of an average adult (8400 kJ/2000 kcal): ', 'Per 100g/ml', '2230', '535', '30.5', '19', '56', '55.5', '8.1', '0.7', '', '0.28', '', 'Per Bar (32g)', '713', '171', '9.8', '6.1', '18', '18', '2.6', '0.2', '', '0.09', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:05', '2016-06-20 01:51:05', NULL),
(343, 343, 'AREM006', 0, '2015-12-11', 'Off Licence', 'Sprits & Liqueurs', 'Cognac & Rum', 'Mount Gay', '', 'Mount Gay is the oldest, most storied, most nuanced rum in the world. Our unique double-spot distillation process came to Barbados with the first merchant ships and is the source of our rum''s distinctive aromatic character since 1703. An opulent blend of the finest spirits aged for 8 to 15 years. Where Eclipse is floral and fruity, Extra Old blends significantly older barrels of mainly double pot distillates that have rounded these crisper notes into a subtler balance. It exudes the finesse that only time can bring and offers a true taste of paradise from the rum that invented rum.', 'A legal deed dated 20th of February 1703 confirms the existence of a "Pot Still House" on our sugarcane estate in Barbados, establishing us as the oldest rum producer in the world. Named in tribute to pioneer Sir John Gay, under whose stewardship the company prospered in the 18th century, Mount Gay is today an award-winning rum of outstanding quality.', 'Barbados Rum', 'Mount Gay Distilleries Limited,\nBrandons,\nSt Michael,\nBarbados,\nWest Indies.', 'www.mountgayrum.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '271', '113', '75', 'Gross Weight: 15', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:05', '2016-06-20 01:51:05', NULL),
(344, 344, 'AREM006', 0, '2015-12-10', 'Off Licence', 'Sprits & Liqueurs', 'Cognac & Rum', 'Mount Gay', '', 'Mount Gay Black Barrel is a small batch handcrafted blend made of aged double pot still distillates and aged column distillates, finished in deeply toasted and charred Bourbon oak barrels. The unique technique releases aromas of spice balanced with oaky vanilla and almond overtones, the signature notes of Mount Gay''s smooth and refined Barbados rum.', 'A legal deed dated 20th of February 1703 confirms the existence of a "Pot Still House" on our sugar cane Estate in Barbados, establishing us as the world''s oldest rum producer. Our name honours the pioneering Sir John Gay who perfected the distinctive Mount Gay style.', 'Barbados Rum', 'Mount Gay Distilleries Limited,\nBrandons,\nSt Michael,\nBarbados,\nWest Indies.', 'www.mountgayrum.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '299', '95', '64', 'Gross Weight: 11', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:05', '2016-06-20 01:51:05', NULL),
(345, 345, 'APRB001', 0, '2015-11-16', 'Off Licence', 'Sprits & Liqueurs', 'Whisky', 'Aberlour', '', 'A welcoming, vibrant and rewarding malt from the Highlands of Scotland. Matured in a combination of hand-selected traditional and Sherry oak casks for a minimum of ten years, this expression represents the very essence of Aberlour character.\n\nColour: Gold.\nNose: The dry, fresh, fruity aromas of early autumn apples and pears are subtly enhanced with sweet notes of vanilla and mint toffee.\nPalate: Exceptionally smooth and creamy, with spicy-sweet nutmeg and honey combining with the freshness of autumn fruits.\nFinish: Long, soft and warming.', '', 'Highland Single Malt Scotch Whisky', 'Aberlour Distillery Company Ltd,\nAberlour,\nSpeyside,\nAB38 9PJ.', 'Aberlour Distillery Company Ltd,\nAberlour,\nSpeyside,\nAB38 9PJ.\nwww.aberlour.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '316', '87', '87', 'Gross Weight: 12', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:05', '2016-06-20 01:51:05', NULL),
