(353, 353, 'AFDB001', 0, '2015-11-30', 'Off Licence', 'Sprits & Liqueurs', 'Whisky', 'Glenfiddich', '', 'This pioneer of the single malt category is matured in the finest Oloroso sherry and bourbon casks and uniquely married in oak tuns for a beautifully balanced nose and refreshingly complex flavour.\n\nMarried for Ultimate Complexity\nAfter being matured in the finest Oloroso sherry and bourbon casks for at least 12 years, our whisky is married in oak tuns by Brian Kinsman, our innovative Malt Master, to give it an unrivalled harmony, complexity and depth.\n\nOur Award-Winning Style\nThe Glenfiddich 12 Year Old is the perfect example of our Speyside signature style, one that has made us the world''s most awarded single malt. A smooth and beautifully balanced nose complemented by refreshingly rich and complex notes of fresh pear and subtle oak.', 'World''s Most Awarded Single Malt Scotch Whisky\nFamily Run Since 1887\nWilliam Grant, our founder, hand-built our distillery with the help of his family in 1887, naming it Glenfiddich, Gaelic for Valley of the Deer. He also established our signature style, taking a high cut point from his small stills, a tradition his family still continues five generations later. Today, our stag symbol represents William''s pioneering spirit.', 'Single Malt Scotch Whisky Aged 12 Years', 'William Grant and Sons Limited,\nThe Glenfiddich Distillery,\nDufftown,\nBanffshire,\nScotland.', 'William Grant and Sons Limited,\nThe Glenfiddich Distillery,\nDufftown,\nBanffshire,\nScotland.\nwww.glenfiddich.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '309', '94', '95', 'Gross Weight: 13', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:05', '2016-06-20 01:51:05', NULL),
