(355, 355, 'AFDB001', 0, '2015-12-02', 'Off Licence', 'Sprits & Liqueurs', 'Other Liqueurs', 'Disaronno', '', 'Disaronno captures the senses with its amber colour, rich aroma and incomparable taste which has made it the world''s favourite Italian liqueur.\n\n1) It''s the Original Amaretto, first created in 1525, the World''s favourite Italian liqueur\n2) Disaronno is an extremely versatile drink, as well as being fantastic neat or on the rocks\n3) Disaronno wear Roberto Cavalli Limited Edition will be available for short time, perfect for a glamorous gift.\n\nDisaronno, the world''s favourite Italian liqueur, will be back this holiday season with a unique new look designed by Roberto Cavalli. The luxury brand has dressed the iconic bottle in the bold, vibrant and colourful style, for which it is famous throughout the world.', '', 'Originale', 'Produced bottled by:\nIllva Saronno S.p.A.,\nItaly.', 'William Grant & Sons UK Limited,\nHook,\nRG27 9XA.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:05', '2016-06-20 01:51:05', NULL),
