(358, 358, 'AWBC001', 0, '2015-12-09', 'Off Licence', 'Beer & Cider', 'Other Lager/Beer', 'Budweiser', '', 'This is the famous Budweiser beer. We know of no brand produced by any other brewer which costs so much to brew and age. Our exclusive Beechwood Aging produces a taste, a smoothness and a drinkability you will find in no other beer at any price.', 'Known as "The King of Beers," Budweiser was first introduced by Adolphus Busch in 1876 and it''s still brewed with the same high standards today. Budweiser is a medium-bodied, flavorful, crisp American-style lager. Brewed with the best barley malt and a blend of premium hop varieties, it is an icon of core American values like optimism and celebration.', 'Beer', '', 'AB Inbev UK Limited,\nLU1 3LS.\nConsumer Helpline: 0870 24 111 24', '', '', '', '', '', '18 Years (Statutory)', 'Packing - Recyclable ', '', '', '', '', '', '', '', '', 'Contains Barley', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:05', '2016-06-20 01:51:05', NULL),
