(378, 378, 'ABAS001', 0, '2015-12-09', 'Off Licence', 'Beer & Cider', 'Premium Ale', 'Sharp''s Brewery', '', 'Doom Bar is inspired by its namesake the treacherous sand bank, located near our home at Rock on Cornwall''s North Atlantic coast.\nAccomplished and precise, Doom Bar is the epitome of consistency, balance and moreish appeal.\n\nStyle: Amber Ale\nTaste Note: "An enticing aroma of resinous hop, sweet malt and delicate roasted notes. The mouth feel is a balanced complex blend of succulent dried fruit, lightly roasted malt and a subtle yet assertive bitterness. The finish is dry and refreshing."\nDirector of Brewing: Stuart Howe', 'Sharp''s Brewery- Est 1994- Raise the bar\n\nSharp''s award winning portfolio is united by delicious moreish character and brewed with passion, precision and expertise to ensure every drop of beer is as good as the last.\n\nEstablished in 1994 at Rock on Cornwall''s North Atlantic coast, Sharp''s Brewery strives to raise the bar for British brewing by producing exceptional beer for the enjoyment of all.', 'Doom Bar Amber Ale.', 'Sharp''s Brewery,\nRock,\nCornwall,\nPL27 6NU.', 'Sharp''s Brewery,\nRock,\nCornwall,\nPL27 6NU.\nConsumer Helpline: 03457 112244 (Local Rate)\nwww.sharpsbrewery.co.uk', '', '', '', '', '', '18 Years (Statutory)', 'Bottle - Glass - Widely Recycled ', '', '', '251', '68', '68', 'Gross Weight: 83', '', '', 'Contains Barley', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:06', '2016-06-20 01:51:06', NULL),
