(383, 383, 'ASCB001', 0, '2016-01-04', 'Off Licence', 'Beer & Cider', 'Lager Bottles', 'Birra Moretti', '', 'To produce Birra Moretti, only the highest quality raw materials are used and a particular mixture of valuable hops give the beer its unique aroma, intensifying the pleasant slight bitter flavour. ABV 4.6%.', 'Birra Moretti was first created in Udine, Italy in 1859 by Luigi Moretti in his Ice and Beer factory and is still brewed to this recipe today. Birra Moretti is an authentic Italian beer, brewed with quality natural ingredients to produce a distinctive golden beer which is a perfect accompaniment with food or to be enjoyed on its own. Birra Moretti is now exported to more than 30 countries worldwide.', 'Beer', 'Heineken Italia S.p.A.,\nViale Edison,\n110 Sesto S. Giovanni,\nItaly.', 'Heineken Italia S.p.A.,\nViale Edison,\n110 Sesto S. Giovanni,\nItaly.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '220', '120', '120', 'Gross Weight: 20', 'Water,Malted Barley,Maize,Hops', '', 'Contains Barley', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:07', '2016-06-20 01:51:07', NULL),
(384, 384, 'AWBC001', 0, '2015-12-08', 'Off Licence', 'Beer & Cider', 'Other Lager/Beer', 'Corona', '', 'Corona is lighter than traditional beers, with a crisp and refreshing taste. This light, dry beer has pleasant malt and hop notes with a round dry finish. Regardless of the time of the year, Corona is best served ice cold, with a wedge of lime that complements and intensifies the flavour through the palate', 'There''s something about drinking a Corona that''s different from drinking any other beer. \nNothing else seems to set the same mood. Nothing else lets the conversation flow so easily between friends. Nothing else brings such a natural energy to an occasion. \nAnd it''s been that way since we started brewing it in 1925.', 'Beer', '', 'AB-Inbev UK,\n500 Capability Green,\nLuton,\nBedfordshire,\nLU1 3LS.\nConsumer helpline: 0870 24 111 24', '', '', '', '', '', '18 Years (Statutory)', 'Packing - Recyclable ', '', '', '244', '242', '61', 'Gross Weight: 22', 'Water,Malt from Barley,Maize and/or Rice,Hops,Antioxidant (E 300),Stabilizer (E 405)', '', 'Contains Barley', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:07', '2016-06-20 01:51:07', NULL),
(385, 385, 'ASCB003', 0, '2015-12-18', 'Off Licence', 'Beer & Cider', 'Cider', 'Strongbow', '', 'Crafted in Herefordshire with our unique blend of British bittersweet cider apples, Strongbow Cloudy Apple is our fresh new take on traditional cloudy cider.\n\nBursting with crisp apple taste and a greater depth of flavour, this new sparkling cider delivers our signature cut through refreshment.', '', 'Sparkling Cloudy Apple Cider for Intense Refreshment.', 'HP Bulmer Ltd.,\nHereford,\nHR4 0LE.', 'HP Bulmer Ltd.,\nHereford,\nHR4 0LE.\nwww.strongbow.com\nConsumer Careline 0345 303 0351\nukcustomerservices@strongbow.com', '', '', '', '', '', '18 Years (Statutory)', 'Bottle - Glass - Widely Recycled ', '', '', '251', '75', '75', 'Gross Weight: 85', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:07', '2016-06-20 01:51:07', NULL),
