(387, 387, 'AMUK001', 0, '2016-01-11', 'Off Licence', 'Sprits & Liqueurs', 'Whisky', 'The Famous Grouse', '', 'The finest Scotch whiskies expertly blended and matured in seasoned oak casks for a rich rounded sweetness.', '', 'Blended Scotch Whisky', 'Matthew Gloag & Son Ltd,\nPerth,\nPH2 7XZ,\nScotland.', 'Matthew Gloag & Son Ltd,\nPerth,\nPH2 7XZ,\nScotland.\nwww.thefamousgrouse.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '150', '68', '32', 'Gross Weight: 28', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:07', '2016-06-20 01:51:07', NULL),
(388, 388, 'ACID001', 0, '2016-01-04', 'Off Licence', 'Beer & Cider', 'Cider', 'Kopparberg', '', 'Bursting with blackcurrants and raspberries, Kopparberg Mixed Fruit Cider spoils you. Rich and indulgent with an effervescent energy, its best served cold over mountains of ice.', 'Tucked away in the Swedish countryside in the small town of Kopparberg, you''ll find a little brewery with unique tastes. Built back in 1882, the Kopparberg Bryggeri, with its traditional red timber falu walls, remains independent and is today owned by the Bronsman family. The brewery is the home of our uniquely refreshing cider. A Swedish fruit pioneer, Kopparberg is exported to the UK and can be found in pubs and bars across the country.', 'Premium Cider with Mixed Fruit', 'Made & bottled by:\nKopparbergs Brewery,\n714 82 Koppaqrberg,\nSweden.', 'www.kopparbergs.se', '', '', '', '', '', '18 Years (Statutory)', 'Sleeve - Recyclable ', '', '', '218', '122', '122', 'Gross Weight: 23', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:07', '2016-06-20 01:51:07', NULL),
(389, 389, 'AMIC005', 0, '2016-01-27', 'Off Licence', 'Red Wine', 'Others', 'Carmen', '', 'Style: Aromatic and silky.', 'Founded in 1850, Carmen is Chile''s first and oldest winery. Premier 1850 is a tribute to our wine-making experience, heritage and prestige.', 'Carmenère - Red Chilean Wine', 'Bottled by:\nViña Carmen S.A.,\nCamino Padre Hurtado 0695,\nBuin,\nChile.', 'Santa Rita Europe Ltd.,\n287-291 Banbury Road,\nOxford,\nOX2 7JQ,\nUK.\nCustomer help line: +44 (0) 1865 404 700\nwww.carmen.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '303', '76', '76', 'Gross Weight: 11', '', '', 'Contains Eggs\nContains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:07', '2016-06-20 01:51:07', NULL),
(390, 390, 'AJRN001', 0, '2015-12-22', 'Off Licence', 'Sprits & Liqueurs', 'Whisky', 'Glen Grant', '', '', 'The Major''s Reserve\nJames Grant, "The Major", was only twenty five when he inherited the Glen Grant Distillery in Rothes, Speyside. A forward thinking and unconventional man, "The Major" personally designed the innovative tall slender stills with unique purifiers to achieve his vision of a seductively smooth, fruity, rich, superior Single Malt. Glen Grant The Major''s Reserve displays a light golden colour with a soft bouquet of delicate apple note. This superb Single Malt offers a fresh and vanilla palate with a slightly dry and hazelnut finish.\n\nEstablished 1840', 'Single Malt Scotch Whisky', 'Produced by:\nGlen Grant Ltd.,\nElgin Road,\nRothes,\nMoray,\nAB38 7BS.', 'Glen Grant Ltd.,\nElgin Road,\nRothes,\nMoray,\nAB38 7BS.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '301', '78', '80', 'Gross Weight: 11', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:07', '2016-06-20 01:51:07', NULL),
(391, 391, 'ACOC001', 0, '2015-12-21', 'Drinks', 'Carbonated Drinks', 'Cola', 'Coca-Cola', '', 'Did you know every time you open a bottle of Coca-Cola 12,607 bubbles are born? Happy Birthday bubbles!\n\nGreat Coke taste\nOnly natural flavours\nNo added preservatives\nGluten-free, dairy-free and nut-free\n\nServe ice cold for maximum refreshment.\n\nKeep one cold in the fridge.\n\nPlease recycle.', 'Coca-Cola and the Environment\nCoca-Cola is committed to making a positive difference - to the health of the planet, consumers and the communities it serves. The company is working hard to reduce its impact on the environment in everything it does - growing more while using less in areas such as energy and water use, waste reduction and recycling - and by encouraging people to think more about the positive impact they can have on their local environment.', 'Sparkling Soft Drink with Vegetable Extracts', 'Coca-Cola Enterprises Ltd,\nUxbridge,\nUB8 1EZ.', 'Coca-Cola Enterprises Ltd,\nUxbridge,\nUB8 1EZ.\n0800 227711\nCoca-Cola.co.uk', '', '', '', '', '', '', 'Bottle - Plastic - Widely Recycled ', 'Suitable for Vegans\nSuitable for Vegetarians', 'Contains caffeine', '', '', '', '', 'Carbonated Water,Sugar,Colour (Caramel E150d),Phosphoric Acid,Natural Flavourings including Caffeine', '', 'Free From Celery\nFree From Cereals Containing Gluten\nFree From Gluten\nFree From Crustaceans\nFree From Eggs\nFree From Fish\nFree From Lupin\nFree From Milk\nFree From Molluscs\nFree From Mustard\nFree From Nuts\nFree From Peanuts\nFree From Sulphur Dioxide/Sulphites\nFree From Soya\nFree From Sesame', '', '', 'Free From Genetically Modified Ingredients', 'Per 100ml: Energy : 180kJ, : 42kcal, Fat : 0g,  of which saturates : 0g, Carbohydrate : 10.6g,  of which sugars : 10.6g, Protein : 0g, Salt : 0g, *Reference intake of an average adult (8400kJ/2000kcal): \nPer 250ml (RI*): Energy : 450kJ, : 105kcal, Fat : 0g (0%),  of which saturates : 0g (0%), Carbohydrate : 27g (10%),  of which sugars