(392, 392, 'ACOC001', 0, '2015-12-21', 'Drinks', 'Carbonated Drinks', 'Canned Carbonated Drinks', 'Coca-Cola', '', 'Coke Zero is the perfect drink for people who want all the taste of Coca‑Cola, without the sugar or calories.\n\nCoke Zero is a sugar free, low calorie soft drink with the great taste of original Coca-Cola.\nZero sugar\nZero Calories\nContains vegetable extracts and sweeteners\nGluten-free, dairy-free and nut-free\n\nServe ice cold for maximum refreshment.\n\nKeep one cold in the fridge\n\nPlease recycle.', 'Coca-Cola and the Environment\nCoca-Cola is committed to making a positive difference - to the health of the planet, consumers and the communities it serves. The company is working hard to reduce its impact on the environment in everything it does - growing more while using less in areas such as energy and water use, waste reduction and recycling - and by encouraging people to think more about the positive impact they can have on their local environment.', 'Sparkling Low Calorie Soft Drink with Vegetable Extracts with Sweeteners', 'Coca-Cola Enterprises Ltd,\nUxbridge,\nUB8 1EZ.', 'Coca-Cola Enterprises Ltd,\nUxbridge,\nUB8 1EZ.\n0800 227711\nCoca-Cola.co.uk', '', '', '', '', '', '', 'Bottle - Plastic - Widely Recycled ', 'Suitable for Vegans\nSuitable for Vegetarians', 'Contains caffeine', '', '', '', '', 'Carbonated Water,Colour (Caramel E150d),Phosphoric Acid,Sweeteners (Aspartame, Acesulfame K),Natural Flavourings including Caffeine,Acidity Regulator (Sodium Citrate)', '', 'Free From Celery\nFree From Cereals Containing Gluten\nFree From Gluten\nFree From Crustaceans\nFree From Eggs\nFree From Fish\nFree From Lupin\nFree From Milk\nFree From Molluscs\nFree From Mustard\nFree From Nuts\nFree From Peanuts\nFree From Sulphur Dioxide/Sulphites\nFree From Soya\nFree From Sesame', '', '', 'Free From Genetically Modified Ingredients', 'Per 100ml: Energy : 1.4kJ, : 0.3kcal, Fat : 0g,  of which saturates : 0g, Carbohydrate : 0g,  of which sugars : 0g, P