(393, 393, 'AGUI001', 0, '2016-01-04', 'Off Licence', 'Sprits & Liqueurs', 'Whisky', 'The Singleton', '', 'Singleton Tailfire is a vibrant evocation of Dufftown''s fruity character with notes of fresh red berries from maturation in European oak casks with notes of sweet vanilla.\nThis enticing new expression of The Singleton of Dufftown is achieved by special cask-selection, enhancing the different characteristics of the Dufftown distillery. The ex-sherry maturation casks are specially selected to enhance the juicy red berry freshness and sweet aromas of vanilla and fresh cut grass.\nWhen sipped, the malt and green grass taste softens quickly, with the richness of the fruit and a hint of spice amongst the sweet oak notes leading to a drying oak finish with a creamy hint of coconut. The nose is one of instant sweetness, ripe red berry fruit - strawberries, stewed plums and raspberry jam, vibrant cut grass emerges with rounded maltiness, giving way to vanilla and toasted oak.\nThe versatile, flavoursome nature of Singleton Tailfire means it can be enjoyed neat, with a drop of water, or over ice.\nThis vibrant single malt is an ideal present for birthdays, Christmas or Father''s Day, but the perfect gift from one person to another isn''t just about what''s inside the wrapping. The perfect gift is about the story and meaning behind what''s being given; what will you say with Singleton Tailfire?\nThe unique flavour combinations of Singleton Tailfire earned it a 2015 Silver Outstanding Medal Winner at the International Wine & Spirits Competition. ', '', 'Single Malt Scotch Whisky Tailfire', 'Diageo,\nLakeside Drive,\nPark Royal,\nLondon,\nNW10 7HQ.', 'Diageo,\nLakeside Drive,\nPark Royal,\nLondon,\nNW10 7HQ. ', '', '', '', '', '', '18 Years (Statutory)', 'Bottle - Recyclable ', '', 'Contains alcohol', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:07', '2016-06-20 01:51:07', NULL),
(394, 394, 'AGUI001', 0, '2016-01-04', 'Off Licence', 'Sprits & Liqueurs', 'Whisky', 'Talisker', '', 'Talisker Skye is special malt full of character and flavoured with a smoky sweetness and a spicy edge, it is rich in contrasts like the compelling Isle of Skye.\nThis vibrant spirit has a bright, 18 carat gold colour with polished copper lights. The palate is very soft and sweet at first with a light smokiness, turning into a long and warming yet fresh finish, with peppery finale and a late trace of sweet smoke.\nThe nose starts gently with the glorious citrus-sweetness of fresh oranges. A touch of water tames the spice and smoke, but the aroma remains maritime.\nThis characterful single malt is an ideal present for birthdays, anniversaries or Father''s Day, but the perfect gift from one person to another isn''t just about what''s inside the wrapping. The perfect gift is about the story and meaning behind what''s being given; what will you say with Talisker Skye?\nIWSC Awards Tasting Note: A lovely mixture of sweet characters of exotic fruits and wild flowers, even hedgerow, is well supported by nutty and spicy notes to deliver perfect balance in the long finish.\n2015 Gold Medal Winner - International Wine & Sprits Competition', '', 'Single Malt Scotch Whisky', 'Talisker Distillery,\nCarbost,\nIsle of Skye,\nIV47 8SR,\nScotland.', 'Talisker Distillery,\nCarbost,\nIsle of Skye,\nIV47 8SR,\nScotland.\nwww.malts.com', '', '', '', '', '', '18 Years (Statutory)', 'Packing - Recyclable ', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:07', '2016-06-20 01:51:07', NULL),
(395, 395, 'AFGL001', 0, '2016-01-06', 'Off Licence', 'Red Wine', 'Australian', 'Wolf Blass', '', 'A full flavoured Cabernet Sauvignon from selected vineyards in South Australia, the heartland of Wolf Blass. Blackcurrant flavours, subtle oak and fine tannins delivers a superbly balanced palate.\nWolfgang Blass AM - Founder.', 'Our winemakers select exquisite single varietals to produce a range of bright, fruit-driven and flavoursome wines.\n\nWolfgang Blass established his winery in 1966, crafting wines which epitomised quality, character and consistency; a philosophy our winemakers continue today.\n\nWe invite you to try other wines in the Wolf Blass range:\nGold Label - Regional Excellence\nYellow Label - Single Varietal\nRed Label - Smooth Blends', 'Cabernet Sauvignon - Red Australian Wine', 'Produced by:\nWolf Blass Wines,\nSturt Highway,\nNuriootpa SA 5355,\nAustralia.', 'Treasury Wine Estates Emea Limited,\nRegal House,\n70 London Road,\nTwickenham,\nMiddlesex,\nTW1 3QS,\nUK.\nwww.wolfblass.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '309', '74', '74', 'Gross Weight: 11', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:07', '2016-06-20 01:51:07', NULL),
