(397, 397, 'AKPS001', 0, '2016-01-28', 'Grocery', 'Crisps & Snacks', 'Single Pack Snacks', 'Hula Hoops', '', 'Our Promise to You...\nHula Hoops are cooked with 100% sunflower oil and are completely free from all artificial flavours, colours and MSG. Of course they still taste as great as ever!\n\nHula Hoops\nBut a Hole lot Bigger!', 'Big Hoops come in a delicious range of flavours. Take Your Pick\nSalted, BBQ Beef, Cheese & Onion, Salt & Vinegar', 'Barbecue Beef Flavour Potato Rings', 'KP Snacks Limited,\nFreepost (LE6531),\nP.O. Box No. 4,\nAshby-de-la-Zouch,\nLeicestershire,\nLE65 1NZ.', 'Quality Guarantee\nPlease contact us on our Careline if you have any questions, comments or suggestions, or write to our Consumer Services Team, enclosing your pack and contents, stating when and where purchased.\nTel: Freephone (UK) 0800 526078 (Mon - Fri 9am - 5pm)\nRepublic of Ireland 1800 620415\nMail:\nKP Snacks Limited,\nFreepost (LE6531),\nP.O. Box No. 4,\nAshby-de-la-Zouch,\nLeicestershire,\nLE65 1NZ.\nEmail via: www.kpsnacks.com ', '', '', '', '', '', '', '', 'Suitable for Vegetarians', '', '155', '105', '30', 'Gross Weight: 53', 'Potato (Dried Potato & Potato Starch),Sunflower Oil (26%),Barbecue Beef Flavour [Rice Flour, Salt, Dried Yeast Extract, Dried Whey (Milk), Dried Onion, Potassium Chloride, Natural Flavourings, Sugar, Maltodextrin, Dried Tomato, Colour: Paprika Extract],Natural Flavouring (contains Potassium Chloride, Salt, Maltodextrin, Dried Onion, Dried Yeast Extract),Salt', '', 'May Contain Gluten\nContains Milk', '', '', 'Free From MSG (Glutamate)\nFree From Artificial Colours\nFree From Artificial Flavours', 'Per 100g: Energy : 2139kJ, : 511kcal, Fat : 26g,  of which Saturates : 2.5g, Carbohydrate : 64g,  of which Sugars : 1.3g, Fibre : 2.4g, Protein : 3.3g, Salt: 1.8g, 50g pack = approximately 2 servings: \nPer 25g Serving: Energy : 535kJ, : 128kcal, Fat : 6.5g,  of which Saturates : 0.6g, Carbohydrate : 16g,  of which Sugars : <0.5g, Fibre : 0.6g, Protei