(399, 399, 'ABAS001', 0, '2016-02-02', 'Off Licence', 'Beer & Cider', 'Premium Lager Cans', 'Carling', '', 'Coors Light, The World''s Most Refreshing BeerTM \nWe''re committed to making sure every person with a tongue gets ice cold refreshment like a blast of cold mountain air, with every single bottle, can or pint of Coors Light they put in their hand.\nOur cold activated cans and bottles not only let you know when you''re drink is cold but Damme Cold!\nEnjoy responsibly\n\nwww.coorslight.co.uk', '', 'Light Beer.', 'Brewed by:\nMolson Coors Brewing Company (UK) Ltd.,\n137 High Street,\nBurton-on-Trent,\nDE14 1JZ.', 'Molson Coors Brewing Company (UK) Ltd.,\n137 High Street,\nBurton-on-Trent,\nDE14 1JZ.\nConsumer helpline: 0845 7112244 (local rate)\nwww.coorslight.co.uk', '', '', '', '', '', '18 Years (Statutory)', 'Can - Metal - Widely Recycled \nFilm - Plastic - Recycle with carrier bags at larger stores - Not at Kerbside ', '', '', '169', '133', '133', 'Gross Weight: 20', '', '', 'Contains Barley\nContains Wheat', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:07', '2016-06-20 01:51:07', NULL),
