(401, 401, 'APRB001', 0, '2016-01-08', 'Off Licence', 'Sprits & Liqueurs', 'Whisky', 'Chivas Regal', '', 'This rich, smooth whisky balances style with substance and tradition. An artful blend of single malts & delicate grain whiskies, matured for at least 12 years. This blend won a Gold Medal at the International Wine & Spirit Competition (IWSC) 2015.\n\nEach whisky in the Chivas Regal range is unique. The founding fathers of the distillery pioneered the art of blending whisky and their traditions have passed down through generations of Master Blenders to preserve the distinct character and quality of every Chivas drop.', 'Aged in handcrafted casks for a minimum of 12 years, Chivas Regal''s smooth rich style has been safeguarded by generations of Master Blenders, making the Chivas Regal name famous throughout the world for over a century.', 'Blended Scotch Whisky', '', 'Ukconsumerfeedback@pernod-ricard.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:07', '2016-06-20 01:51:07', NULL),
(402, 402, 'AINT044', 0, '2016-01-11', 'Off Licence', 'White Wine', 'Other French', 'Unbranded', '', 'A beautifully refreshing white wine with bold fruity and floral aromas. The wine has a delightfully full texture, but still displays the classic finesse and elegance of the Muscadet region. ', '', 'Muscadet - White French Wine', 'Bottled by:\nPierre Chainier.\n\nAt:\nF37400,\nAmbois.\n\nShipped by:\nInternational Procurement and Logistics Ltd,\nWF6 1TN,\nUK.', 'International Procurement and Logistics Ltd,\nWF6 1TN,\nUK.', '', '', '', '', '', '18 Years (Statutory)', 'Bottle - Glass - Widely Recycled ', '', '', '310', '82', '82', 'Gross Weight: 11', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:07', '2016-06-20 01:51:07', NULL),
