(405, 405, 'AMUK001', 0, '2016-01-11', 'Off Licence', 'Sprits & Liqueurs', 'Cognac & Rum', 'Courvoisier', '', 'Courvoisier® was served and celebrated at the spectacular opening of the Eiffel Tower in 1889, at the heart of the Paris golden age. Perfectly capturing the sheer exhilaration of this magical era, this VS is made of a celebratory and mouth-watering blend of Eaux-de-vie offering complex fruity notes and Oaky richness and depth. Paris golden age (1870 - 1910) was a time of artistic freedom and extravagance. This light and uplifting cognac defines the most celebratory era in French history.', '', 'Cognac', 'Cognac Courvoisier,\n16200 Jarnac,\nFrance.', 'Maxxium UK Ltd,\nMaxxium House,\nCastle Business Park,\nStirling,\nFK9 4RT.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '222', '105', '43', 'Gross Weight: 80', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:08', '2016-06-20 01:51:08', NULL),
(406, 406, 'ACOP001', 0, '2016-01-12', 'Off Licence', 'Red Wine', 'Spanish', 'I Heart', '', 'A smooth, ripe red brimming with black fruit flavours and a note of spice.', 'We''ve sourced our wines from some of the most famous, top quality wine-producing regions in the world. The mission was simple, to make a great quality wine that we are sure you will enjoy. We didn''t find this hard. We have found something that captures all we love about good wine right here in this bottle. Perfect for every occasion we love.\n\nWe love wine. We love everything about wine. We love that there is always something new to try. It might be a grape variety, a style, a country or even a left-field food match. This range is a collection of some of our favourite wines. All you have to do is follow your heart and pour yourself a glass.', 'Shiraz - Red Spanish Wine', 'Bodegas Virgen del Aguila,\nS.Coop. R.E. 2680-Z Paniza,\nSpain.', 'Copestick Murray,\nSN8 4AN,\nUK.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '301', '75', '75', 'Gross Weight: 11', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:08', '2016-06-20 01:51:08', NULL),
