(408, 408, 'ACID001', 0, '2016-01-21', 'Off Licence', 'Beer & Cider', 'Cider', 'Kopparberg', '', 'Like summer in a glass; a splash of fresh strawberries in apple juice, and a squeeze of tangy lime. Kopparberg Strawberry & Lime Cider is perfect for Summer BBQs. Drink it over ice and the job''s done.', 'Tucked away in the Swedish countryside in the small town of Kopparberg, you''ll find a little brewery with unique tastes. Built back in 1882, the Kopparberg Bryggeri, with its traditional red timber falu walls, remains independent and is today owned by the Bronsman family. The brewery is the home of our uniquely refreshing cider. A Swedish fruit pioneer, Kopparberg is exported to the UK and can be found in pubs and bars across the country.', 'Premium Cider with Strawberry & Lime', 'Kopparbergs Brewery,\n714 82 Kopparberg,\nSweden.', 'Kopparbergs Brewery,\n714 82 Kopparberg,\nSweden.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '230', '71', '71', 'Gross Weight: 83', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:08', '2016-06-20 01:51:08', NULL),
(409, 409, 'ACID001', 0, '2016-01-21', 'Off Licence', 'Beer & Cider', 'Cider', 'Kopparberg', '', 'Bursting with blackcurrants and raspberries, Kopparberg Mixed Fruit Cider spoils you. Rich and indulgent with an effervescent energy, its best served cold over mountains of ice.', 'Tucked away in the Swedish countryside in the small town of Kopparberg, you''ll find a little brewery with unique tastes. Built back in 1882, the Kopparberg Bryggeri, with its traditional red timber falu walls, remains independent and is today owned by the Bronsman family. The brewery is the home of our uniquely refreshing cider. A Swedish fruit pioneer, Kopparberg is exported to the UK and can be found in pubs and bars across the country.', 'Mixed Fruit Premium Cider', 'Made & bottled by:\nKopparbergs Brewery,\n714 82 Kopparberg,\nSweden.', 'www.kopparbergs.se', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '230', '72', '72', 'Gross Weight: 67', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:08', '2016-06-20 01:51:08', NULL),
(410, 410, 'ACID001', 0, '2016-01-21', 'Off Licence', 'Beer & Cider', 'Cider', 'Kopparberg', '', 'The juices of plump pears in Kopparberg Pear Cider are infused with our naturally occurring soft water, to create the perfect combination of a refreshingly light and fruity cider, with the punch of a strong pear taste. It is deliciously thirst quenching and full of life.  ', 'Tucked away in the Swedish countryside in the small town of Kopparberg, you''ll find a little brewery with unique tastes. Built back in 1882, the Kopparberg Bryggeri, with its traditional red timber falu walls, remains independent and is today owned by the Bronsman family. The brewery is the home of our uniquely refreshing cider. A Swedish fruit pioneer, Kopparberg is exported to the UK and can be found in pubs and bars across the country.', 'Premium Cider Pear', 'Made & Bottled by:\nKopparbergs Brewery,\nSweden.', 'www.kopparbergs.se', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '230', '71', '71', 'Gross Weight: 83', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:08', '2016-06-20 01:51:08', NULL),
(411, 411, 'AMTC001', 0, '2016-01-20', 'Off Licence', 'Champagne & Rose', 'Rose Wine Other', 'Echo Falls', '', 'This lovely crisp and fruity Rosé wine brings a girly and cheeky charm to the table. Coming from sunny California it has hints of strawberries and fresh summer berries.', 'At Echo Falls our winemakers are passionate about creating modern and delicious wines, perfect for nights in and social get-togethers.', 'White Zinfandel - Rosé Californian Wine', 'Bottled by:\nAccolade Wines Ltd.,\nWeybridge,\nKT13 8TB,\nUK.\n\nAt:\nBS11 9FG,\nUK.', 'Accolade Wines Ltd.,\nWeybridge,\nKT13 8TB,\nUK.\nwww.echofallswine.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:08', '2016-06-20 01:51:08', NULL),
