(448, 448, 'AIRI007', 0, '2016-03-22', 'Off Licence', 'Sprits & Liqueurs', 'Cognac & Rum', 'Martell', '', 'Produced from the most prestigious Crus of the Cognac region, Martell Fine Cognac VS is light golden in colour, perfectly set off by aromas of spices and fresh fruits. This harmonious cognac with a robust character can be enjoyed on its own, over ice or in a cocktail.', '', 'Fine Cognac', 'Martell & Co.,\n16100 Cognac,\nFrance.', 'Martell & Co.,\n16100 Cognac,\nFrance.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '291', '92', '92', 'Gross Weight: 11', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:10', '2016-06-20 01:51:10', NULL),
