(450, 450, 'AIRI007', 0, '2016-03-22', 'Off Licence', 'Red Wine', 'Spanish', 'Campo Viejo', '', 'Grape: Tempranillo.\nTasting: Deep cherry colour which is typical of vibrant Tempranillo wine. The wine has a pronounced nose full of rich intense aromas of ripe red fruits with subtle, sweet notes of vanilla and sweet spices. The palate is fresh, soft and velvety with flavours of redcurrants, vanilla and chocolate leading to a long elegant finish.\nCarefully matured for more than one year in our cellar.', 'Passion and expertise for Rioja winemaking and the most refined methods allow us to create expertise wines. Campo Viejo: the expert art of winemaking.', 'Tempranillo - Red Spanish Wine', 'Bodegas Campo Viejo,\nLogroño,\nEspaña.', 'www.campoviejo.com\nwww.wineinmoderation.eu', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '301', '75', '75', 'Gross Weight: 11', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:10', '2016-06-20 01:51:10', NULL),
