(452, 452, 'AIRI007', 0, '2016-03-22', 'Off Licence', 'White Wine', 'Australian', 'Jacob''s Creek', '', 'Our winemaking tradition dates back to 1847 when Johann Gramp planted his first vineyard on the banks of Jacob''s Creek.\nA medium bodied wine, with attractive lemon, ripe peach, melon and subtle oak flavours. Enjoy on its own or with grilled vegetables, fish or chicken.\nBernard Hickin, Winemaker', 'Named after Jacob''s Creek, Site of Johann Gramp''s first vineyard\n\nWinemaker since 1847', 'Classic Chardonnay - White Australian Wine', 'Jacob''s Creek Wines,\nBarossa Valley Way,\nRowland Flat,\nSA 5352,\nAustralia.\n\nBottled by:\nW1743,\nUK.', 'Questions, Comments or Suggestions - Contact us at: www.pernod-ricard-uk.com\nPernod Ricard Winemakers Pty Ltd,\nChiswick Park,\nW4 5AN.\nwww.jacobscreek.com', '', '', '', '', '', '18 Years (Statutory)', 'Packing - Recyclable ', '', '', '299', '78', '78', 'Gross Weight: 11', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:10', '2016-06-20 01:51:10', NULL),
(453, 453, 'AIRI007', 0, '2016-03-22', 'Off Licence', 'White Wine', 'New Zealand', 'Brancott Estate', '', 'Sourced from a range of Marlborough vineyards, this Sauvignon Blanc presents an exhilarating blend of stonefruit with subtle herbal notes, while tropical fruit and grapefruit notes complements its fresh acidity.', 'Our story began over 40 years ago with a bold idea to plant vines in Marlborough, New Zealand. At the time, the South Island was considered too cold to grow grapes, but we challenged this thinking and planted the very first Sauvignon Blanc vines in Marlborough. It was this pioneering spirit that led to something spectacular; the distinctive and vibrant expression of Sauvignon Blanc now loved the world over\nChief Winemaker', 'Sauvignon Blanc - White New Zealand Wine', 'Brancott Estate Ltd,\n38 Liverpool Street,\nBlenheim 7274,\nNew Zealand.', 'Questions, Comments or Suggestions\nContact us at: www.pernod-ricard-uk.com\nPernod Ricard Winemakers Pty Ltd,\n3 Lampton Road,\nHounslow,\nMiddlesex,\nTW3 1HY,\nUK.\nwww.brancottestate.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '299', '81', '81', 'Gross Weight: 11', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:10', '2016-06-20 01:51:10', NULL),
