(462, 462, 'ASNL001', 0, '2016-03-21', 'Off Licence', 'Beer & Cider', 'Premium Ale', 'Spitfire', '', 'This 4.5% Kentish ale was first brewed in 1990 to celebrate the battle of Britain which was fought in the skies above Kent 50 years earlier.\nThe beer is named after the legendary spitfire aeroplane designed by R J Mitchell.\nThe versatility of the aircraft and the courage of its pilots were essential to victory and the spitfire is a key symbol of the spirit of that time.\n\nSee - Dark Amber, Auburn\nSmell - Fruit, Toffee, Hoppy\nTaste - Spicy, Hoppy, Bitter', 'Spitfire - The Bottle of Britain', 'Premium Kentish Ale', 'Brewed & bottled by:\nShepherd Neame Ltd,\nFaversham Kent,\nME13 7AX,\nEngland.', 'Shepherd Neame Ltd,\nFaversham Kent,\nME13 7AX,\nEngland.\nwww.spitfireale.co.uk', '', '', '', '', '', '18 Years (Statutory)', 'Packing - Recyclable ', '', '', '221', '76', '76', 'Gross Weight: 83', 'Water,Hops and Malted Barley', '', 'Contains Barley', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:10', '2016-06-20 01:51:10', NULL),
(463, 463, 'ASCB001', 0, '2016-04-01', 'Off Licence', 'Beer & Cider', 'Other Lager/Beer', 'Theakston', '', 'Brewed using a generous blend of finest pale, crystal and roasted barley malts, along with the majestic Fuggle hop, to create a wonderful, full-bodied flavour with subtle banana, cherry and rich fruit overtones.', 'Theakston''s most famous ale takes its name from the seal of the Peculier Court of Masham, which was granted back in the 12th century. It was the custom at the time for the church to administer the law, but this proved too arduous a task for the then Archbishop, who was based in York. So, with due archiepiscopal aplomb, he set up the independent Peculier Court, headed up by the Peculier of Masham.', 'Beer', 'T&R Theakston Ltd,\nMasham,\nRipon,\nHG4 4YD,\nUK.', 'T&R Theakston Ltd,\nMasham,\nRipon,\nHG4 4YD,\nUK.\ntheakston.co.uk\nCustomer Careline: 0345 030 3278\nReturn for refund where applicable', '', '', '', '', '', '18 Years (Statutory)', 'Bottle - Glass - Widely Recycled ', '', '', '238', '70', '70', 'Gross Weight: 78', '', '', 'Contains Barley\nContains Wheat', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:10', '2016-06-20 01:51:10', NULL),
(464, 464, 'AFDB001', 0, '2016-05-09', 'Off Licence', 'Sprits & Liqueurs', 'Vodka', 'Russian Standard', '', 'Original vodka using winter wheat from the Russian steppes & pure glacial water from Lake Ladoga', 'In 1894 Dmitry Mendeleev, the greatest scientist in all Russia, received a decree from the Tsar to create the Imperial quality standard for Russian vodka. The ''Russian Standard'' was born.\nToday in St Petersburg, our state-of-the-art distillery allows us to bring this vodka heritage into the 21st Century. Using winter wheat from the Russian Steppes and pure glacial water from Lake Ladoga, we have created the genuine taste of Russian vodka that is once again being celebrated throughout the world.', 'Vodka\n\n', 'Russian Standard Vodka,\n46/2 Pulkovskoye Shosse 196140,\nSaint Petersburg,\nRussia\nwww.russianstandardvodka.com', '', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:10', '2016-06-20 01:51:10', NULL),
