(470, 470, 'ADAF005', 0, '2016-03-22', 'Off Licence', 'Sprits & Liqueurs', 'Gin', 'Daffy''s', '', 'Lebanese Mint, Juniper, Coriander, Angelica, Lemon Peel, Cassia and Orris', 'The adventure started with our discovery of what Lebanese mint can bring to the finest gin. Balanced with eight other carefully chosen botanicals, we have created an exceptionally fresh, smooth, and truly original gin with complexity and balanced charm.\nDaffy', 'The Finest Copper Pot Single-Batch Distilled Gin', 'Daffy''s Gin Ltd,\n3-5 Melville St,\nEdinburgh,\nEH3 7PE.', 'Daffy''s Gin Ltd,\n3-5 Melville St,\nEdinburgh,\nEH3 7PE.\ndaffysgin.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:11', '2016-06-20 01:51:11', NULL),
(471, 471, 'AJRN001', 0, '2016-03-08', 'Off Licence', 'Sprits & Liqueurs', 'Cognac & Rum', 'Appleton Estate', '', 'For those who are looking for a rum that is delicious and alive, vivid and deep with a flavour that is complex and aromatic then Appleton Estate Signature Blend is the perfect rum. This mature blend of premium aged rum is produced on the Appleton Estate in Jamaica, home to award winning rums since 1749. Appleton Estate Signature Blend is born in copper pot stills, aged in oak casks for an average of four years and meticulously hand blended. \n\nThe full rich flavour of Appleton Estate Signature Blend is a delicious blend of the best 15 aged golden rums. This blend has a warm honey colour and a lush fruity, bold, rich taste with notes of orange peel. It is a perfect every day rum, enjoy with ginger beer for a Jamaican Mule. Appleton Estate Signature Blend also makes delicious rum cocktails. 100% Jamaican from cane to cup.\n\nRecommended Serve: \nJamaican Mule\nHighball glass, cubed ice \n1. 50ml Appleton Estate Signature Blend\n2. Top ginger beer\n3. Garnish squeeze of fresh lime\n\nwww.youtube.com/AppletonEstateRumUK\nwww.facebook.com/appletonestate.uk\nwww.twitter.com/appletonrumuk \nwww.instagram.com/appletonrumuk', '', 'Rum', '', 'Gruppo Campari, \nLevel 27, \nThe Shard, \n32 London Bridge St, \nLondon,\nSE1 9SG.\nwww.appletonestate.com', '', '', '', '', '', '18 Years (Statutory)', 'Bottle - Glass - Widely Recycled ', '', '', '232', '111', '84', 'Gross Weight: 12', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:11', '2016-06-20 01:51:11', NULL),
