(473, 473, 'AHWE001', 0, '2016-03-10', 'Off Licence', 'Beer & Cider', 'Cider', 'Henry Westons', '', '', 'In 1880 Henry Weston first started crafting cider from the bittersweet apples grown on his farm in Much Marcle, Herefordshire. Over many years he refined the art of Herefordshire cider making. Today, Henry Westons Vintage Cider is produced only from apples in a single year''s harvest in the three counties of Herefordshire, Gloucestershire & Worcestershire. The cider is then slowly matured in aged oak vats to deliver a smooth, rounded, medium-dry cider packed with magnificently exceptional character.', 'Vintage Oak Aged Herefordshire Cider', 'Produced & bottled by:\nH. Weston & Sons Ltd.,\nMuch Marcle,\nHerefordshire,\nHR8 2NQ.', 'H. Weston & Sons Ltd.,\nMuch Marcle,\nHerefordshire,\nHR8 2NQ.\nwww.westons-cider.co.uk', '', '', '', '', '', '18 Years (Statutory)', '', 'Suitable for Coeliacs\nSuitable for Vegans\nSuitable for Vegetarians', '', '267', '70', '70', 'Gross Weight: 81', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:11', '2016-06-20 01:51:11', NULL),
(474, 474, 'ACCS002', 0, '2016-03-18', 'Drinks', 'Carbonated Drinks', 'Other Flavoured Carbonated Drinks', 'Relentless', '', 'Where intense fruit flavour refreshment meets the energy needed by those who are driven to pursue their goals with passion and commitment.\n\nRelentless is an energy drink that helps give you the stamina, focus and drive you need, when you need it.\nHigh caffeine Content\n\nServe cold for maximum refreshment.\n\nStore in a cool and dry place\n\nPlease recycle.\n\nThe journey towards artistry and committing everything for your moment is an accolade in itself. Greatness or glory doesn''t come by accident, it is earned.\n\nIn forging, in our humble opinion, the ultimate Energy Drink, we set upon a quest not for perfection, but one of passion to produce a drink worthy of the name Relentless.\n\nIt''s refreshing, smooth finish and uncompromising flavour knows no boundaries.\n\nBe unwavering in your personal pursuit of greatness…..\n\nBe Relentless!', 'Coca-Cola and the Environment\nCoca-Cola is committed to making a positive difference - to the health of the planet, consumers and the communities it serves. The company is working hard to reduce its impact on the environment in everything it does - growing more while using less in areas such as energy and water use, waste reduction and recycling - and by encouraging people to think more about the positive impact they can have on their local environment.', 'Carbonated Cherry Flavour Energy Drink with Taurine, Caffeine, Guarana and B Vitamins with Sugar and Sweeteners', 'Energy Beverages Europe Limited,\nSouth Bank House,\nBarrow Street,\nDublin 4,\nIreland.', 'Energy Beverages Europe Limited,\nSouth Bank House,\nBarrow Street,\nDublin 4,\nIreland.\nRelentlessenergy.com', '', '', '', '', '', '', '', '', 'Contains caffeine', '', '', '', '', 'Carbonated Water,Sucrose,Acid (Citric Acid),Taurine (0.4%),Preservatives (Potassium Sorbate, Sodium Benzoate),Caffeine (0.03%),Carrot and Blackcurrant Concentrates