(502, 502, 'ASCB001', 0, '2016-05-03', 'Off Licence', 'Beer & Cider', 'Other Lager/Beer', 'Heineken', '', 'Heineken is a 5 % premium lager with a delicate hop and malt aroma. Underlying tropical and apple flavours combine with a clean palate and refreshing finish with some hop notes.', 'Founded in 1873, brewed in Amsterdam and now sold in over 180 countries around the world, Heineken® is the world''s leading international premium beer brand.', 'Heineken Premium Lager Beer', 'Heineken Brouwerijen B.V.,\nAmsterdam,\nHolland.', 'Heineken UK Ltd,\n2-4 Broadway Park,\nEdinburgh,\nEH12 9JZ.\nConsumer Careline 0845 840 0057\ncustomerservices@heineken.co.uk\nwww.heineken.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '277', '74', '74', 'Gross Weight: 10', 'Water,Malted Barley,Hops', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:12', '2016-06-20 01:51:12', NULL),
(503, 503, 'ABAS001', 0, '2016-04-01', 'Off Licence', 'Beer & Cider', 'Other Lager/Beer', 'Blue Moon', '', 'North American craft beer\n\nA refreshing, un-filtered wheat beer brewed and spiced in the Belgian tradition for a uniquely complex taste & an uncommonly smooth finish.\n\nBlue Moon is brewed with oats for creaminess and spiced with the perfect combination of orange peel and coriander. Bring out the subtle flavours by serving it with an orange-slice garnish.', 'Blue Moon Brewing Company was born in 1995 in Denver, Colorado, U.S.A., when we added unique and subtle twists to old-world, handcrafted brewing traditions. Since then, not much has changed. Still just a bunch of friends having fun making great beer. What''s not to love about that?', 'North American Craft Beer ', '', 'Blue Moon Brewing Company,\n137 High Street,\nBurton-on-Trent,\nDE14 1JZ,\nUK.\nConsumer helpline: 0845 7112244 (calls charged at local rate).\nwww.bluemoonbrewingcompany.co.uk', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '218', '64', '64', 'Gross Weight: 56', '', '', 'Contains Barley\nContains Wheat', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:12', '2016-06-20 01:51:12', NULL),
(504, 504, 'ABAS001', 0, '2016-04-01', 'Off Licence', 'Beer & Cider', 'Cider', 'Rekorderlig', '', 'Rekorderlig Strawberry-Lime Cider was the first to explore this unique flavour combination.  Enjoy served over ice with fresh mint leaves or real strawberries and a wedge of lime for a fresh, zesty experience\n\nRekorderlig Ciders : Beautifully Swedish', 'Our cider was first created in 1999 with the purest spring water from Vimmerby, Sweden, where it is still made today by Abro Bryggeri. From its humble Swedish roots, Rekorderlig has retained its dependable honesty to become a much-loved, fourth generation family-brewed cider. Stocked in a wide range of the UK''s favourite bars and supermarkets, Rekorderlig continues to launch in new countries while strongly maintaining its proud Swedish heritage. Rekorderlig is a premium cider that you can rely on and trust. With a typically Swedish fusion of high-end design and modesty, it has a clear identity that sets it apart from others. Enjoyed by those who yearn for something refreshingly different, join Rekorderlig on a journey of exploration, innovation and invigoration.', 'Premium Strawberry-Lime Cider', 'Abro Bryggeri,\nVimmerby,\nSweden.', 'UK & EIRE: Chilli Marketing. Tel: 0870 24 24 608', '', '', '', '', '', '18 Years (Statutory)', '', '', 'Not suitable for vegans or vegetarians', '229', '72', '72', 'Gross Weight: 82', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:12', '2016-06-20 01:51:12', NULL),
