(506, 506, 'AGUI001', 0, '2016-03-31', 'Off Licence', 'Beer & Cider', 'Other Lager/Beer', 'Guinness', '', 'The 1800s were the golden age of porter and in Dublin and London it was the working man''s beer. Guinness has played an important role in the years since then in making porter, and its cousin stout, an iconic beer style around the world.\n\nGuinness Dublin Porter has origins in our historic brewers'' diaries going back as far as our 1st recorded entry in 1796. Luis Ortega, one of the brewers from The Brewers Project, took inspiration from our porter recipes across the centuries to create this new beer for modern tastes.\n\nGuinness Dublin Porter is tasty and well-rounded. This everyday beer is sweet and smooth with malt and dark caramel notes.', 'Brewer Source 1796\n\nSt. James''s Gate Dublin\n\nBest served chilled (between 5-7ºC) in a beer glass.', 'Dublin Porter', 'Guiness & Co.,\nLondon,\nNW10 7HQ.', 'Guiness & Co.,\nLondon,\nNW10 7HQ.', '', '', '', '', '', '18 Years (Statutory)', '', '', 'Contains alcohol', '', '', '', '', '', '', 'Contains Barley', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:12', '2016-06-20 01:51:12', NULL),
