(508, 508, 'AEJG001', 0, '2016-04-04', 'Off Licence', 'Red Wine', 'Others', 'Barefoot', '', 'Barefoot Merlot is packed with the tempting flavours of blackberry, raspberry and chocolate and is silky smooth. Great served with beef, poultry, pasta with tomato sauces, cheese and dessert.', '', 'Merlot - Red Californian Wine', 'Barefoot Cellars,\nModesto,\nCA.,\nU.S.A. 95354.', 'Barefoot Cellars Europe,\nHarman House,\nUxbridge,\nUB8 1OQ,\nU.K.\nwww.barefootwine.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '302', '74', '74', 'Gross Weight: 11', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:13', '2016-06-20 01:51:13', NULL),
(509, 509, 'AEJG001', 0, '2016-04-04', 'Off Licence', 'White Wine', 'Others', 'Gallo Family Vineyards', '', 'Gallo Family Vineyards White Grenache is a light-bodied wine.  Treat your taste buds with vibrant flavours of fresh strawberry, watermelon and a touch of floral spice.  Crisp and fresh with a smooth finish it is refreshing and great to enjoy either by itself or with a variety of food.', '', 'White Grenache - Rosé Californian Wine', 'Vinted and bottled by: \nE. & J. Gallo Winery,\nModesto,\nCA. 95354,\nU.S.A.', 'Gallo Family Vineyards Europe,\nSwan House,\nCowley Business Park,\nUxbridge,\nUB8 2AD,\nU.K.\nwww.gallo.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '303', '74', '74', 'Gross Weight: 11', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:13', '2016-06-20 01:51:13', NULL),
(510, 510, 'AEJG001', 0, '2016-04-04', 'Off Licence', 'White Wine', 'Others', 'Gallo Family Vineyards', '', 'Gallo Family Vineyards White Zinfandel a medium-bodied wine. With a gorgeous, jewel-like colour, the wine has fruit flavours of dried cranberry, watermelon and fresh cherry. The White Zinfandel has lingering aromas of sweet raspberries and notes of tropical fruit.', '', 'White Zinfandel - Rosé Californian Wine', 'Vinted and bottled by: \nE. & J. Gallo Winery,\nModesto,\nCA. 95354,\nU.S.A.', 'Gallo Family Vineyards Europe,\nSwan House,\nCowley Business Park,\nUxbridge,\nUB8 2AD,\nU.K.\nwww.gallo.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '302', '74', '74', 'Gross Weight: 11', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:13', '2016-06-20 01:51:13', NULL),
(511, 511, 'AEJG001', 0, '2016-04-04', 'Off Licence', 'White Wine', 'American', 'Barefoot', '', 'Barefoot Pinot Grigio is crisp and full of citrus and peach flavours. Goes well with chicken, seafood, spicy pasta and pizzas.', '', 'Pinot Grigio - White Californian Wine', 'Barefoot Cellars,\nModesto,\nCA.,\nU.S.A. 95354.', 'Barefoot Cellars,\nSwan House,\nCowley Business Park,\nUxbridge,\nUB8 2AD,\nU.K.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '302', '75', '75', 'Gross Weight: 11', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:13', '2016-06-20 01:51:13', NULL),
(512, 512, 'AGUI001', 0, '2016-03-31', 'Off Licence', 'Sprits & Liqueurs', 'Whisky', 'Johnnie Walker', '', 'Johnnie Walker Red Label is the world''s best-selling Blended Scotch Whisky, loved for its vibrant, spicy flavours and its mixability. Originally developed to be enjoyed in new markets all around the globe, Johnnie Walker Red Label epitomises the pioneering vision of the Walker family who took the blend from Scotland to the four corners of the world', 'By Appointment to Her Majesty The Queen Scotch Whisky Distillers John Walker & Sons Limited, London', 'Red Label Whisky', 'John Walker & Sons,\nKilkmarnock,\nKA3 1HD,\nScotland.', 'Johnnie Walker,\nLakeside Drive,\nPark Loyal,\nLondon,\nNW10 7HQ.\nwww.johnniewalker.com\nCareline: 0845 601 4558', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:13', '2016-06-20 01:51:13', NULL),
(513, 513, 'ASCB001', 0, '2016-04-04', 'Off Licence', 'Beer & Cider', 'Lager Bottles', 'Caledonian', '', 'Three Hop Craft Lager is solid gold in colour with spice and a hint of honey in the aroma, earthy and herbal flavours with a lingering lemony finish.\n\nTogether they produce a lager that is solid gold in colour with spice and a hint of honey in the aroma, earthy and herbal flavours with a lingering lemony finish.', 'At Caledonian Brewery we have been inspired by the brewing regions of Europe for this crafted lager. Germany, France and the Czech Republic each have their own unique traditions and ingredients - and we''ve selected what we believe is the perfect combination of three hops. Hallertau Hersbrucker from Bavaria, Saaz from Bohemia and Strisselspalt from Alsace were chosen to create a trinity of aroma, flavour and finish. Add nearly 150 years of brewing experience and you get one delicious, distinctive and deeply satisfying lager.\n\nThree Hop Lager 4.5% abv Hop character in lager is delicate and understated, so instead of choosing one hop, we wanted to brew the lager that celebrates the lager traditions of Germany, the Czech Republic and France. Each region offers a distinctive hop; Hallertau Hersbrucker from Bavaria, Saaz from Bohemia and Strisselspalt from Alsace.', 'A Solid Gold Lager with Spicy Minty Aromas, Herbal then Lingering Lemony Flavours', 'Caledonian Brewery,\n42 Slateford Road,\nEdinburgh,\nEH11 1PH,\nUK.', 'Caledonian Brewery,\n42 Slateford Road,\nEdinburgh,\nEH11 1PH,\nUK.\ninfo@caledonianbeer.com\ncaledonianbeer.com', '', '', '', '', '', '', 'Bottle - Glass - Widely Recycled ', '', '', '212', '61', '61', 'Gross Weight: 56', '', '', 'Contains Barley', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:13', '2016-06-20 01:51:13', NULL),
(514, 514, 'ASCB001', 0, '2016-04-04', 'Off Licence', 'Beer & Cider', 'Other Lager/Beer', 'Caledonian', '', 'Coast to Coast Pale 4.6% abv We''ve married six American hops from the Yakima valley, the hotbed of the West Coast hop scene with the best brewing barley from the East Coast to create a polished bronze ale with piny and citrus fruit aromas, malty spicy flavours and a zesty rounded bitterness.', 'We brewers at Caledonian are continually searching for new and special ingredients to create interesting and flavoursome beers. We love the citrus and tropical fruit notes from the US west coast hops, expressed so well in American Pale Ale, the hoppier interpretation of its English cousin. We thought we would steal some thunder back from America''s western seaboard and pair these hops with the renowned Maritime Malt, the world''s best brewing barley from our own east coast. Coast to Coast is a polished bronze ale with pine and citric fruit aromas, malty spicy flavours and a zesty rounded bitterness.', 'A Bronze Ale with Fresh Citrus and Piny Hop Aroma, Light Malt with Zesty Rounded Bitterness', 'Caledonian Brewery,\n42 Slateford Road,\nEdinburgh,\nEH11 1PH,\nUK.', 'Caledonian Brewery,\n42 Slateford Road,\nEdinburgh,\nEH11 1PH,\nUK.\ninfo@caledonianbeer.com\ncaledonianbeer.com', '', '', '', '', '', '18 Years (Statutory)', 'Bottle - Glass - Widely Recycled ', '', '', '212', '62', '62', 'Gross Weight: 56', '', '', 'Contains Barley', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:13', '2016-06-20 01:51:13', NULL),
(515, 515, 'AGUI001', 0, '2016-03-31', 'Off Licence', 'Sprits & Liqueurs', 'Gin', 'Gordon''s', '', 'Gordon''s Gin is the world''s best-selling London Dry Gin. Its juniper and citrus influenced character has earned it the reputation as the ginniest of gins\nGordon''s classic style, makes it the perfect gin for the definitive gin and tonic.  \nGordon''s gin is an icon of quality and most recognised and loved gin brand in the UK\nTaste Profile: Juniper forward gin, which when mixed with tonic water and served with a slice of lime, gives a crisp refreshing tasting gin and tonic\nThe distinctively refreshing taste comes from using only the finest ingredients including juniper, coriander seeds and angelica root\nEstablished in 1769, Gordon''s has 247 years of distilling heritage and has been awarded 4 royal warrants, the first of which was in 1925 by King George V', 'Gordon''s gin was established in 1769 by Alexander Gordon as he set out on a mission to produce a gloriously-flavoured gin worthy of carrying his family name. Gordon believed that success lay in the perfect combination of pure distilled grain spirit and rich botanicals. To this day Gordon''s is distilled to this same exacting standard, the product is triple distilled to guarantee the purity of the gin, and the exact blend of our botanicals remains a closely guarded secret. The attention to detail results in a distinctive that mixes perfect in long mixed drinks and cocktails.\n\nTo savour the great taste for yourself, mix a Gordon''s & Tonic and garnish with lime. It''s the classic long mixed drink, ideal any time, but especially good when enjoyed with friends.', 'The Original Special Dry London Gin', '', 'Careline: 0845 601 4882', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '93', '42', '23', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:13', '2016-06-20 01:51:13', NULL),
(516, 516, 'AGUI001', 0, '2016-03-31', 'Off Licence', 'Beer & Cider', 'Stout', 'Guinness', '', 'Brewed to perfection for over 200 years. Crack it open. The unmistakable deep-dark colour. The crisp hint of roasted barley, the fresh breeze of hops. The refreshing bite. The bittersweet reward. Pure beauty. Pure Guinness.\n\nGuinness Original works well with spiced deserts, cheeses and fish - especially lobster', 'If you were in a pub sometime between 1821 and 1970, chances are this is the Guinness you would have been drinking. Originally brewed as the XX version of our Porter, it''s hoppy, roasty and crisp with a bittersweet finish.\n\nServe chilled. Hold your glass at 45 degree angle, pour and slowly allow the head to develop. Then enjoy.', 'Original Extra Stout', 'Guinness & Co.,\nLondon,\nNW10 7HQ.', 'Guinness & Co.,\nLondon,\nNW10 7HQ.\nCustomer Care Line: 08457 882277\nwww.guinness.com', '', '', '', '', '', '18 Years (Statutory)', 'Can - Recyclable ', '', '', '151', '134', '134', 'Gross Weight: 18', '', '', 'Contains Barley', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:13', '2016-06-20 01:51:13', NULL),
(517, 517, 'AGUI001', 0, '2016-03-31', 'Off Licence', 'Sprits & Liqueurs', 'Cognac & Rum', 'Captain Morgan', '', 'Enjoy the legendary mix, Captain Morgan Original Spiced Gold and Cola (with Caffeine), pre-mixed in a can for the perfect serve every time. \nAlways best served chilled, or enjoy a Captain and Cola in a glass with ice and lime for a smooth, refreshing taste. The pre-mixed can means you and your crewmates can enjoy the Captain''s legendary spirit, wherever you are.\nExpertly blended with rich spice and natural flavours, Captain Morgan Original Spiced Gold is a premium spirit drink made with the finest Caribbean Rum, aged in charred white oak barrels to create a rich colour and taste.\nNotes of rich natural vanilla, brown sugar, dried fruit, warming spices and hints of oak come together to create a perfectly balanced spirit with a smooth finish. \nCaptain Henry Morgan was a legendary figure in the Caribbean. After years at sea as a Buccaneer he was appointed governor of Jamaica, party capital of land and sea, in 1680. The spirit of Sir Henry Morgan lives on in his legendary rum drinks.\nLive Like the Captain!', '', 'A Spirit Drink of Premium Caribbean Rum Blended with Mellow Spices Mixed with Cola (with Caffeine)', 'Produced for:\nThe Capt Morgan Rum Co.,\nLakeside Drive,\nPark Royal,\nLondon,\nNW10 7HQ,\nUK.', 'The Capt Morgan Rum Co.,\nLakeside Drive,\nPark Royal,\nLondon,\nNW10 7HQ,\nUK.\nUK: 0845 6014882\nROI: 1850 250000', '', '', '', '', '', '18 Years (Statutory)', 'Packing - Recyclable ', '', '', '135', '53', '53', 'Gross Weight: 26', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:13', '2016-06-20 01:51:13', NULL),
(518, 518, 'AGUI001', 0, '2016-03-31', 'Off Licence', 'Beer & Cider', 'Other Lager/Beer', 'Guinness', '', 'Quality has always been in GUINNESS'' DNA, even back in the 1800s when faced with the challenge of how to maintain the freshness of our beer on long sea voyages. To guarantee the best quality upon arrival, GUINNESS brewers made a porter with more hops and higher gravity. \n\nThe recipe was a success and was soon shipped far and wide to countries in the Caribbean, America, Africa and South East Asia. Its ancestor, GUINNESS FOREIGN EXTRA STOUT is still sold there today.\n\nWith origins in an 1801 entry in GUINNESS'' brewers'' diaries, today''s GUINNESS WEST INDIES PORTER was inspired by the first beer purposely brewed at St. James''s Gate to sustain its freshness, wherever it was shipped. The beer is complex yet mellow, hoppy with notes of toffee and chocolate.', 'Brewer Source 1801\n\nSt. James''s Gate Dublin', 'West Indies Porter', 'Guinness & Co.,\nSt. James''s Gate,\nDublin 8,\nIreland.\n\nGuinness & Co.,\nLondon,\nNW10 7HQ.', 'Guinness & Co.,\nSt. James''s Gate,\nDublin 8,\nIreland.\n\nGuinness & Co.,\nLondon,\nNW10 7HQ.\nConsumer Care Line Numbers: ROI 1850 250000 / GB 08457 88277\nwww.guinness.com\n', '', '', '', '', '', '18 Years (Statutory)', 'Packing - Recyclable ', '', '', '217', '74', '74', 'Gross Weight: 80', '', '', 'Contains Barley', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:13', '2016-06-20 01:51:13', NULL),
(519, 519, 'AREF001', 0, '2016-04-19', 'Off Licence', 'Sprits & Liqueurs', 'Gin', 'Martin Miller''s', '', 'Distilled in England, Westbourne Strength is handcrafted in small batches using a copper pot still and taking only the spirit''s ''heart''. Created using two separate distillates, one heavily reliant on Juniper, the other citrus, the two distillates are skilfully blended giving this gin its unique balance of herbaceous Juniper and brilliant citrus notes. Blended to a bottling strength of 45.2%, Westbourne Strength is bright, and soft with attractive, complex aromas of Pepper and Cassia. With its long, dry finish this multi-award winning gin is the perfect accompaniment to all the classic cocktails, G&Ts, and makes the perfect dry Martini.\n\nWestbourne Strength was first launched in 2003 in response to requests by ''Mixologists'' for a higher strength version of Martin Miller''s Gin. It was immediately awarded 97 points by the respected beverage testing institute. In 2015 it was once again awarded 97 points. A score that has not been bettered by any other gin in the last 12 years.', 'About 75 km north of Reykjavik, standing by Borgarfjörður, is the small village of Borgarnes. First noted in the Icelandic sagas as the home of the famous Viking warrior and ''Berserker'' Egils Skallagrimsson, Borgarnes was authorised as a trading port in 1861 and it was to here that Martin Miller was drawn in his search for the perfect water with which to craft his gin. So pure it requires no treatment prior to use, it is the secret at the heart of all Martin Miller''s Gins.', 'Gin', 'Bottled for:\nThe Reformed Spirits Co. Ltd.,\nPlaza 535,\nKings Road,\nLondon,\nSW10 0SZ.', 'The Reformed Spirits Co. Ltd.,\nPlaza 535,\nKings Road,\nLondon,\nSW10 0SZ.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:13', '2016-06-20 01:51:13', NULL);
