(520, 520, 'ACOC001', 0, '2016-03-31', 'Drinks', 'Carbonated Drinks', 'Cola', 'Coca-Cola', '', 'Did you know every time you open a bottle of Coca-Cola 12,607 bubbles are born? Happy Birthday bubbles!\n\nGreat Coke taste\nOnly natural flavours\nNo added preservatives\nGluten-free, dairy-free and nut-free\n\nServe ice cold for maximum refreshment.\n\nKeep one cold in the fridge.\n\nPlease recycle.', 'Coca-Cola and the Environment\nCoca-Cola is committed to making a positive difference - to the health of the planet, consumers and the communities it serves. The company is working hard to reduce its impact on the environment in everything it does - growing more while using less in areas such as energy and water use, waste reduction and recycling - and by encouraging people to think more about the positive impact they can have on their local environment.', 'Sparkling Soft Drink with Vegetable Extracts', 'Coca-Cola Enterprises Ltd,\nUxbridge,\nUB8 1EZ.', 'Coca-Cola Enterprises Ltd,\nUxbridge,\nUB8 1EZ.\n0800 227711\nCoca-Cola.co.uk', '', '', '', '', '', '', 'Bottle - Plastic - Widely Recycled ', 'Suitable for Vegans\nSuitable for Vegetarians', 'Contains caffeine', '', '', '', '', 'Carbonated Water,Sugar,Colour (Caramel E150d),Phosphoric Acid,Natural Flavourings including Caffeine', '', 'Free From Celery\nFree From Cereals Containing Gluten\nFree From Gluten\nFree From Crustaceans\nFree From Eggs\nFree From Fish\nFree From Lupin\nFree From Milk\nFree From Molluscs\nFree From Mustard\nFree From Nuts\nFree From Peanuts\nFree From Sulphur Dioxide/Sulphites\nFree From Soya\nFree From Sesame', '', '', 'Free From Genetically Modified Ingredients', 'Per 100ml: Energy : 180kJ, : 42kcal, Fat : 0g,  of which saturates : 0g, Carbohydrate : 10.6g,  of which sugars : 10.6g, Protein : 0g, Salt : 0g, *Reference intake of an average adult (8400kJ/2000kcal): \nPer 250ml (%*): Energy : 450kJ, : 105kcal (5%), Fat : 0g (0%),  of which saturates : 0g (0%), Carbohydrate : 27g (10%),  of which su