(526, 526, 'AMTC001', 0, '2016-04-05', 'Off Licence', 'White Wine', 'American', 'Echo Falls', '', 'This smooth, dry Chardonnay from sunny California is full of crisp lemon, ripe peach and tropical fruit flavours, making it a light and luscious wine that is ideal for sipping and sharing with friends.', 'Our emerging designer range has been designed and crafted by Holly Fulton, a talented British designer whose signature prints we think were great match for Echo Falls. The label illustrates her style and passion for colour and pattern which were her main inspirations for the designs. This fits in very well for the vibrant and colourful brand that Echo Falls is known for.\n\nAt Echo Falls our winemakers are passionate about creating modern and delicious wines, perfect for nights in and social get-togethers.', 'Chardonnay - White Californian Wine ', 'Bottled by:\nAccolade Wines Ltd.,\nWeybridge,\nKT13 8TB,\nUK.\n\nAt:\nBS11 9FG,\nUK.', 'Accolade Wines Ltd.,\nWeybridge,\nKT13 8TB,\nUK.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:13', '2016-06-20 01:51:13', NULL),
(527, 527, 'AMTC001', 0, '2016-04-05', 'Off Licence', 'Red Wine', 'American', 'Echo Falls', '', 'Dark, rich and dashingly tasty, this Merlot hails from the Central Valley region in sunny California, and is a must on any dining table. Soft and dry with hints of ripe plums, black cherries and blueberries, it is perfect for parties, cosy nights in or barbecues. Lovely on its own, or perfect when paired with lamb or beef dishes.', 'At Echo Falls our winemakers are passionate about creating modern and delicious wines, perfect for nights in and social get-togethers.\n\nIf you like our smooth & rich Merlot, why not try our lively Echo Falls Shiraz?', 'Merlot - Red Californian Wine', 'Bottled by:\nAccolade Wines Ltd.,\nWeybridge,\nKT13 8TB,\nUK.\n\nAt:\nBS11 9FG,\nUK.', 'Accolade Wines Ltd.,\nWeybridge,\nKT13 8TB,\nUK.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '302', '75', '75', 'Gross Weight: 11', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:13', '2016-06-20 01:51:13', NULL),
(528, 528, 'AMTC001', 0, '2016-04-05', 'Off Licence', 'White Wine', 'American', 'Echo Falls', '', 'This delectable fresh white wine comes from the Central Valley in sunny California and is an irresistible addition to your table. Bright citrus notes and flavours of crisp fresh apple make this a vibrant and tasty wine that''s ideal on its own, paired with a light Caesar or Nicoise salad, or with a seafood risotto.', 'At Echo Falls our winemakers are passionate about creating modern and delicious wines, perfect for nights in and social get-togethers.\n\nIf you like our mouth-watering Pinot Grigio, why not try our light and refreshingly sparkling Echofalls Spritz?', 'Pinot Grigio - White Californian Wine', 'Bottled by:\nAccolade Wines Ltd.,\nWeybridge,\nKT13 8TB,\nUK.\n\nAt:\nBS11 9FG,\nUK.', 'Accolade Wines Ltd.,\nWeybridge,\nKT13 8TB,\nUK.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '302', '75', '75', 'Gross Weight: 11', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:13', '2016-06-20 01:51:13', NULL),
(529, 529, 'AMTC001', 0, '2016-04-05', 'Off Licence', 'White Wine', 'Australian', 'Hardys', '', 'Thomas Hardy''s pioneering spirit and passion for winemaking spans five generations and is at the heart of our outstanding range of Hardys Wines.\n\nA fruity Chardonnay with juicy characters of white peach, nectarine and subtle hints of vanilla.', 'Since the first vintage in 1853 the Hardy family have been making wine to be enjoyed the world over. Bin 161 celebrates this history with the launch of this approachable, easy-drinking range of wines in Hardy''s 161st year.', 'Chardonnay - White Australian Wine', 'Bottled by:\nAccolade Wines Ltd.,\nWeybridge,\nKT13 8TB,\nUK.\n\nAt:\nBS11 9FG,\nUK.', 'Accolade Wines Ltd.,\nWeybridge,\nKT13 8TB,\nUK.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', 'Contains Milk\nContains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:14', '2016-06-20 01:51:14', NULL),
