(541, 541, 'AMTC001', 0, '2016-04-05', 'Off Licence', 'White Wine', 'Australian', 'Hardys', '', 'A crisp and refreshing Sauvignon Blanc with flavours of passionfruit and gooseberry, complemented by a citrus finish - great with lightly spiced chicken dishes.', 'Thomas Hardy''s pioneering spirit and passion for winemaking spans five generations and is at the heart of our outstanding range of Hardys Wines.\n\nWe created the Varietal Range to share the experience and diversity of wine in an uncomplicated way for everyone to enjoy. The wines for this range are fruity and easy drinking and display true varietal character.', 'Sauvignon Blanc - White Australian Wine', 'Bottled by:\nAccolade Wines Ltd.,\nWeybridge,\nKT13 8TB,\nUK.\n\nAt:\nBS11 9FG,\nUK.', 'Accolade Wines Ltd.,\nWeybridge,\nKT13 8TB,\nUK.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', 'Contains Milk\nContains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:14', '2016-06-20 01:51:14', NULL),
(542, 542, 'AMTC001', 0, '2016-04-05', 'Off Licence', 'Red Wine', 'Others', 'Hardys', '', 'We created the Varietal Range to share the experience and diversity of wine in an uncomplicated way for everyone to enjoy. The wines for this range are fruity and easy drinking and display true varietal character.\n\nA well-rounded Shiraz with flavours of sweet ripe plum and red berries that are complemented by subtle spice on the finish - great with Italian inspired dishes.', 'Thomas Hardy''s pioneering spirit and passion for winemaking spans five generations and is at the heart of our outstanding range of Hardys Wines.', 'Shiraz - Red Australian Wine', 'Bottled by:\nAccolade Wines Ltd.,\nWeybridge,\nKT13 8TB,\nUK.\n\nAt:\nBS11 9FG,\nUK.', 'Accolade Wines Ltd.,\nWeybridge,\nKT13 8TB,\nUK.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '301', '76', '76', 'Gross Weight: 11', '', '', 'Contains Eggs\nContains Milk\nContains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:14', '2016-06-20 01:51:14', NULL),
(543, 543, 'AMTC001', 0, '2016-04-05', 'Off Licence', 'Red Wine', 'South African', 'Kumala', '', 'The name Kumala comes from a combination of local tribal dialects and means ''to do things differently.'' \n\nMedium bodied with ripe blackberry and plum fruit. Juicy with a long, velvety finish and well balanced tannins.\n\nKumala keeps on going from strength to strength and is arguably producing the best wine it has ever made under the confident leadership of Bruce Jack. The reason for this is the close relationship between the grape growers and our top winemakers. South Africa''s wine producing area has 5 distinct regions, divided into 14 distinct districts. At Kumala, grapes are sourced from a number of these regions so that only the best quality is chosen. The grapes for Kumala Cape Red were fermented in stainless steel tanks to keep the juicy red fruit aromas before contact with French oak to add some spice and tannin. Recently awarded the title of Wine Personality of the Year at the Financial Mail Wine Business Awards, Bruce Jack is one of South Africa''s biggest movers and shakers making distinctive, stylish wines.', '', 'Red South African Wine', 'Bottled by:\nAccolade Wines Ltd.,\nWeybridge,\nKT13 8TB,\nUK.\n\nAt:\nBS11 9FG,\nUK.', 'Accolade Wines Ltd.,\nWeybridge,\nKT13 8TB,\nUK.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:14', '2016-06-20 01:51:14', NULL),
(544, 544, 'AMTC001', 0, '2016-04-05', 'Off Licence', 'White Wine', 'South African', 'Kumala', '', 'The name Kumala comes from a combination of local tribal dialects and means ''to do things differently.'' \n\nKumala keeps on going from strength to strength and is arguably producing the best wine it has ever made under the confident leadership of Bruce Jack. The reason for this is the close relationship between the grape growers and our top winemakers. South Africa''s wine producing area has 5 distinct regions, divided into 14 distinct districts. At Kumala, grapes are sourced from a number of these regions so that only the best quality is chosen. The grapes for Kumala Cape White were fermented in open stainless steel tanks for 2 weeks without any oak use. This helps to keep the wine really fresh and fruity. Recently awarded the title of Wine Personality of the Year at the Financial Mail Wine Business Awards, Bruce Jack is one of South Africa''s biggest movers and shakers making distinctive, stylish wines.', '', 'White South African Wine', 'Bottled by:\nAccolade Wines Ltd.,\nWeybridge,\nKT13 8TB,\nUK.\n\nAt:\nBS11 9FG,\nUK.', 'Accolade Wines Ltd.,\nWeybridge,\nKT13 8TB,\nUK.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', 'Contains Milk\nContains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:14', '2016-06-20 01:51:14', NULL),
(545, 545, 'AMTC001', 0, '2016-04-05', 'Off Licence', 'Red Wine', 'South African', 'Kumala', '', 'A juicy, smooth full-bodied red wine, with red berry fruit, ripe plums and a hint of spice on the rich, lingering finish.', 'Surrounding South Africa''s legendary table mountain is a place of lush fertility and natural beauty. This is the home of Kumala, where we make quality wines that are full of character.', 'Merlot Cabernet Sauvignon Shiraz - Red South African Wine', 'Bottled by:\nAccolade Wines Ltd.,\nWeybridge,\nKT13 8TB,\nUK.\n\nAt:\nBS11 9FG,\nUK.', 'Accolade Wines Ltd.,\nWeybridge,\nKT13 8TB,\nUK.\nwww.kumala.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '309', '74', '74', 'Gross Weight: 11', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:14', '2016-06-20 01:51:14', NULL),
