(573, 573, 'ASCB001', 0, '2016-05-02', 'Off Licence', 'Beer & Cider', 'Lager Bottles', 'Tiger', '', 'Tiger is brewed using our tropical lagering process, making it a uniquely refreshing full-bodied beer.\n\nTiger Beer is a refreshing and full bodied lager beer with a light straw colour, soft beady aroma and a hint of tropical fruit. Its malty character is immediately noticeable, with a silky texture on the palate and has a clean, crisp finish when served chilled.', 'Tiger is a premium world lager with true heritage and authenticity. Since 1932, it has been brewed with dedication to a unique Far Eastern recipe with the finest quality hops and malted barley. Tiger has a distinctive taste that is winning the world over with 40 international awards to date.', 'Lager Beer', 'Heineken UK Ltd,\n3-4 Broadway Park,\nEdinburgh,\nEH12 9JZ.', 'Consumer Careline 0845 840 0059\nwww.tigerbeer.co.uk\nHeineken UK Ltd,\n3-4 Broadway Park,\nEdinburgh,\nEH12 9JZ.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', 'Contains Barley', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:16', '2016-06-20 01:51:16', NULL),
