(575, 575, 'AMUK001', 0, '2016-05-06', 'Off Licence', 'Sprits & Liqueurs', 'Whisky', 'Jim Beam', '', 'Aged in the heart of Kentucky, Jim Beam® Kentucky Straight Bourbon Whiskey is made for those who take their bourbon seriously.\nJim Beam White derives its rich satisfying flavour from a treasured family recipe and minimum of four years of ageing in new, charred oak barrels. You will find flavours of caramel and vanilla followed by a clean finish.\nJim Beam White is perfect savoured neat over ice or why not try Jim Beam Citrus Highball? Fill a tall glass with ice; add a squeeze of lemon, 25ml of Jim Beam White and top with soda.', '', 'Kentucky Straight Bourbon Whiskey', 'Beam Suntory UK Ltd.,\nSpringburn Bond,\nCarlisle Street,\nGlasgow,\nScotland.\nG21 1EQ.', 'Beam Suntory UK Ltd.,\nSpringburn Bond,\nCarlisle Street,\nGlasgow,\nScotland.\nG21 1EQ.\n\nMaxxium UK Ltd,\nMaxxium House,\nCastle Business Park,\nStirling,\nFK9 4RT.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '258', '78', '78', 'Gross Weight: 10', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:16', '2016-06-20 01:51:16', NULL),
(576, 576, 'ASCB001', 0, '2016-04-22', 'Off Licence', 'Beer & Cider', 'Premium Bitter', 'Sol', '', 'Sol is a blond, light and refreshing, golden coloured Pilsner-style lager, with a fresh, malty, fruity-lemony flavour and a soft, quenching dry finish with a 4.5% alcohol by volume content.', 'Sol® is the original Mexican Lager born in 1899 in Independent Mexico', 'Beer', 'Brewed and bottled by Moctezuma Brewing Co. in the Netherlands under supervision of\nCerveceria Cuauhtémoc Moctezuma,\nS.A. de C.V.,\nMonterrey,\nMexico.', 'Heineken UK Ltd.,\n2-4 Broadway Park,\nEdinburgh,\nEH12 9JZ.\n\nHeineken Ireland Ltd.,\nLeitrim Street,\nCork.\nConsumer information hotline 1850 514466\nwww.sol.com', '', '', '', '', '', '18 Years (Statutory)', 'Carton - Card - Widely Recycled ', '', '', '236', '120', '120', 'Gross Weight: 22', '', '', 'Contains Barley', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:16', '2016-06-20 01:51:16', NULL),
(577, 577, 'AWES025', 0, '2016-05-24', 'Off Licence', 'Sprits & Liqueurs', 'Whisky', 'Jack Daniel''s', '', '', '', 'Tennessee Sour Mash Whiskey', 'Brown-Forman Beverages Europe Ltd.,\n45 Mortimer Street,\nLondon,\nW1W 8HJ,\nUK.', 'Brown-Forman Beverages Europe Ltd.,\n45 Mortimer Street,\nLondon,\nW1W 8HJ,\nUK.\njackdaniels.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '174', '77', '38', 'Gross Weight: 41', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:16', '2016-06-20 01:51:16', NULL),
(578, 578, 'AWES025', 0, '2016-05-24', 'Off Licence', 'Sprits & Liqueurs', 'Whisky', 'Jack Daniel''s', '', 'Mellowed\nFor smoothness drop by drop through sugar maple charcoal\n\nMatured\nFor character in our own handcrafted barrels\n\nTasted\nFor flavor by masters until deemed ready\n\nAwarded\nFor quality and distinction 7 gold medals since 1904', 'Quality & craftmanship since 1866', 'Tennessee Sour Mash Whiskey', 'Brown-Forman Beverages Europe Ltd.,\n45 Mortimer Street,\nLondon,\nW1W 8HJ,\nUK.', 'Brown-Forman Beverages Europe Ltd.,\n45 Mortimer Street,\nLondon,\nW1W 8HJ,\nUK.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '115', '36', '36', 'Gross Weight: 13', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:16', '2016-06-20 01:51:16', NULL),
(579, 579, 'AWES025', 0, '2016-05-25', 'Off Licence', 'Sprits & Liqueurs', 'Whisky', 'Jack Daniel''s', '', 'Tasting Notes: \n\nFlavour profile: Full and spicy\nColour: Warm amber\nNose: Sweet, rich, vanilla\nTaste: Hints of orange, brown sugar and spice, full-bodied oak and dry apple', 'Jack Daniel''s Old No. 7 is a premium Tennessee Whiskey.\n\nA warm amber colour with aromas of sweet vanilla, this is a smooth, full-bodied whiskey, with flavours of orange, brown sugar and spice, and a long rich finish.\n\nJack Daniel registered his distillery in 1866, making it the oldest registered distillery in the United States. It''s here in Lynchburg that every drop of Jack Daniel''s Tennessee Whiskey is still produced and bottled today. \n\nDuring its 150 year history, Jack Daniel''s has won numerous gold medals around the world. Its success can be put down to the unique way in which the famous ''Old No.7'' brand is made, the same way it always has - using the finest corn, rye and barley malt; pure, iron-free water from the Cave Spring in the Distillery hollow; being mellowed through 10 feet of sugar maple charcoal; and aged in hand-crafted charred oak barrels.\n\nIt is this unique way of making whiskey and the extra steps such as charcoal mellowing that makes Jack Daniel''s what it is - a smooth sipping Tennessee whiskey and not a bourbon. \n\nFor one of the world''s best-known drinks, fill a glass with ice, pour in a measure of Jack Daniel''s Old No. 7 and top with cola. Or simply enjoy neat over ice for slow sipping. \n\n70cl bottle, 28 serves in every bottle (25ml per serve).\n\nEnergy per 100ml: 218kcal\nEnergy per 25ml: 54kcal', 'Tennessee Sour Mash Whiskey', 'Distilled and bottled by:\nJack Daniel Distillery,\nTennessee,\nU.S.A.\n\nBrown-Forman Beverages Europe Ltd.,\n45 Mortimer Street,\nLondon,\nWIW 8HJ,\nUK.\nUK.', 'Brown-Forman Beverages Europe Ltd.,\n45 Mortimer Street,\nLondon,\nW1W 8HJ,\nUK.\njackdaniels.com', '', '', '', '', '', '18 Years (Statutory)', '', '', 