(594, 594, 'ACON003', 0, '2016-05-09', 'Off Licence', 'White Wine', 'Others', 'Casillero del Diablo', '', 'Winemaker''s Note\nCrafted using grapes from three of Chile''s coastal regions. This cooler climate brings out the best qualities as the grapes ripen later, allowing the intense fruit flavours to shine through.\n\nHow It Tastes\nA refreshing light-bodied Sauvignon Blanc with zesty peach, citrus fruit and gooseberry flavours.', '', 'Sauvignon Blanc - White Chilean Wine', 'Produced and bottled by:\nViña Concha y Toro S.A.,\nNueva Tajamar 481,\nTorre Norte,\nPiso 15,\nSantiago.', 'Concha y Toro UK Ltd.,\nOxfordshire,\nEngland,\nOX33 1ER,\nU.K.\nwww.casillerodeldiablo.com\nwww.chileanlegend.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:17', '2016-06-20 01:51:17', NULL),
(595, 595, 'ACON003', 0, '2016-05-09', 'Off Licence', 'Red Wine', 'Others', 'Casillero del Diablo', '', 'Winemaker''s Note\nCrafted using grapes form Chile''s Central Valley. Warm days followed by cooler nights provide near-perfect growing conditions, resulting in rich smooth fruity flavours.\n\nHow it Tastes\nA smooth, full-bodied Cabernet Sauvignon with cassis and black cherry flavours, complemented by hints of coffee and dark chocolate.', '"More than 100 years ago Don Melchor de Concha y Toro reserved for himself an exclusive batch of the best wines he produced. And, to keep strangers away form his private reserve, he spread the rumor that the devil lived in that place. Hence the name: Casillero del Diablo or Cellar of the Devil."', 'Cabernet Sauvignon - Red Chilean Wine', 'Produced and bottled by:\nViña Concha y Toro S.A.,\nNueva Tajamar 481,\nTorre Norte Piso 15,\nSantiago,\nChile.', 'Concha y Toro UK Ltd.,\nOxfordshire,\nEngland,\nOX33 1ER,\nUK.\nwww.casillerodeldiablo.com\nwww.chileanlegend.com', '', '', '', '', '', '18 Years (Statutory)', '', '', 'Not suitable for vegetarians and not suitable for vegans', '176', '52', '52', 'Gross Weight: 33', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:17', '2016-06-20 01:51:17', NULL),
