(597, 597, 'ACON003', 0, '2016-05-09', 'Off Licence', 'White Wine', 'Others', 'Isla Negra', '', 'High Tide is that magical time when the ocean subsides to the gravitational pull of the moon and reaches its maximum potential. This fresh and crisp Sauvignon Blanc offers that same plenitude in its citrus-rich nose interlaced with herbal and green apple notes. In mouth there''s refreshing acidity, balance and a slightly mineral finish that will pair outstandingly well with seafood, spices, salads, vegetable stews and mild-flavoured cheeses.', '', 'Sauvignon Blanc - White Chilean Wine', 'Produced and bottled by:\nV.C.S. S.A.,\nNueva Tajamar 481,\nTorre Sur,\nOf 2101,\nSantiago,\nChile.', 'Viña Cono Sur Europe Ltd.,\nWheatley,\nOX33 1ER,\nU.K.\nwww.islanegrawines.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '297', '85', '85', 'Gross Weight: 12', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:17', '2016-06-20 01:51:17', NULL),
(598, 598, 'ACON003', 0, '2016-05-09', 'Off Licence', 'Red Wine', 'Others', 'Isla Negra', '', 'The ripe blackcurrant flavours of Cabernet Sauvignon combine perfectly with the flavours of Merlot.  Ideal with grills, stews, rich pasta dishes and strong cheeses.', 'Isla Negra is a seaside village, famous for the artists and writers who come here to be inspired by the ocean and the mystical landscape.', 'Cabernet Sauvignon Merlot - Red Chilean Wine', 'Produced and bottled by:\nV.C.S. S.A.,\nNueva Tajamar 481,\nTorre Sur,\nOf 2101,\nSantiago,\nChile.', 'Viña Cona Sur Europe Ltd.,\nWheatley,\nOX33 1ER,\nU.K.\nwww.islanegrawines.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '288', '76', '76', 'Gross Weight: 11', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:17', '2016-06-20 01:51:17', NULL),
(599, 599, 'AGUI001', 0, '2016-04-26', 'Off Licence', 'Sprits & Liqueurs', 'Other Spirits', 'Pimm''s', '', 'Whether you''re chilling with a group of friends, hosting a family gathering, or simply relaxing with someone special, it''s pretty much never not Pimm''s O''Clock!\n\nPimm''s Original is the perfect drink for sharing; making every occasion extra special and deliciously memorable. Take a jug (or long drink glass) and fill it with ice. Mix one part Pimm''s No.1 with three parts chilled lemonade. Then add some mint, cucumber, orange and strawberries - and enjoy.', '', 'Spirit Drink', 'Office 30,\n78 Marylebone High Street,\nLondon,\nW1U 5AP.', 'Office 30,\n78 Marylebone High Street,\nLondon,\nW1U 5AP.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '298', '75', '75', 'Gross Weight: 10', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:17', '2016-06-20 01:51:17', NULL),
(600, 600, 'AGUI001', 0, '2016-04-26', 'Off Licence', 'Sprits & Liqueurs', 'Gin', 'Tanqueray', '', 'Craft: A blend of the purest, four-times distilled spirit with hand picked botanicals, which are added to the neutral spirit and condensed for a richer and deeper flavour. The result is a uniquely balanced gin taste. One could say that to create this masterpiece, the neutral spirit is the canvas and the botanicals are the rich brushstrokes that adorn it.\n\nQuality: With contents this precious, every bottle has a seal. A symbol of unrivalled and unparalleled quality. Perhaps it''s because only the top 10% of botanicals sent to the distillery are deemed good enough for the bottle. One is honoured to be one of the only gins in the world with a Royal Warrant too.\nLooking for the perfect G&T? Choose Tanqueray for a pure expression of rich flavoursome botanicals. It also makes the perfect base for classic cocktails such as the Martini, the Singapore Slim and the Tom Collins.', 'It starts with the man. Charles Tanqueray. The bold spirit who traded the church for the still and in the process, created one of the world''s most awarded gins. Tonight we toast the bold spirit worthy of its seal and 180 years of distilling excellence.', 'London Dry Gin Export Strength', 'Distillery 11,\n78 Marylebone High Street,\nLondon,\nW1U 5AP.', 'Distillery 11,\n78 Marylebone High Street,\nLondon,\nW1U 5AP.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '242', '89', '89', 'Gross Weight: 12', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:17', '2016-06-20 01:51:17', NULL),
(601, 601, 'AGUI001', 0, '2016-04-27', 'Off Licence', 'Sprits & Liqueurs', 'Gin', 'Gordon''s', '', 'Gordon''s Crisp Cucumber offers a sophisticated and contemporary twist to the G&T experience\n\nGordon''s Crisp Cucumber marries the aromatic, crisp flavour of cucumber with delicious Gordon''s London Dry Gin. \n\nFrom the first sip you''ll enjoy its sweet, vanilla and herbal notes and its pepper and crisp cucumber taste - a bright freshness to enjoy any time of the year.\n\nFor a G&T with a sophisticated twist, garnish with a slice of lemon and a thin slice of cucumber. ', 'To savour the great taste for yourself, mix a Gordon''s Crisp Cucumber Gin with Tonic and garnish with wedge of lemon and thin slice of cucumber. It''s the classic long mixed drink, ideal any time, but especially good when enjoyed with friends.', 'Crisp Cucumber', 'Tanqueray Gordon & Co.,\nLakeside Drive,\nNW10 7HQ.', 'Tanqueray Gordon & Co.,\nLakeside Drive,\nNW10 7HQ.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '254', '84', '69', 'Gross Weight: 10', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:17', '2016-06-20 01:51:17', NULL),
(602, 602, 'AGUI001', 0, '2016-04-27', 'Off Licence', 'Sprits & Liqueurs', 'Whisky', 'Johnnie Walker', '', 'Whisky experts regard Johnnie Walker Black Label as the Michelangelo''s David of the blender''s art. With more than 30 Malt and Grain whiskies from the best distilleries in the world, blended to perfection to deliver an unparalleled depth of flavour, it is considered “the Everest of deluxe whiskies”', 'By Appointment to Her Majesty the Queen Scotch Whisky Distillers John Walker & Sons Limited, London', 'Black Label Blended Scotch Whisky', 'John Walker & Sons,\nKilmarnock,\nKA3 1HD,\nScotland.', 'Diageo,\n5 Lochside Way,\nEdinburgh,\nEH12 9DT,\nScotland.\nwww.johnniewalker.com\nCareline: 0845 601 4558', '', '', '', '', '', '18 Years (Statutory)', 'Packing - Recyclable ', '', '', '290', '92', '71', 'Gross Weight: 11', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:17', '2016-06-20 01:51:17', NULL),
(603, 603, 'AGUI001', 0, '2016-04-27', 'Off Licence', 'Sprits & Liqueurs', 'Whisky', 'Talisker', '', 'Deep and stormy like the ocean crashing over the rocky shores of its island distillery; Talisker is the only single malt scotch whisky rugged enough to call the Isle of Skye its home.\nSpicy, mellow, smoky flavours combine with a honeyed sweet maltiness and an explosion of pepper, before the culmination of a clean, warming finish, with a lasting aftertaste.\nSavour Talisker Storm''s peppery sweet and salty flavours neat, or draw them out gently by adding a little water to your glass.\nThis hugely popular single malt is an ideal present for birthdays, anniversaries or Father''s Day, but the perfect gift from one person to another isn''t just about what''s inside the wrapping. The perfect gift is about the story and meaning behind what''s being given; what will you say with Talisker Storm?\nThe intense and smoky vibrant maritime notes earned a 2015 Silver Outstanding Medal Winner at the International Wine & Spirits Competition.', 'No whisky reveals the character of its birthplace better than Talisker®\nTo know Talisker is to feel the power of the sea, and sense its rugged location on the banks of Loch Harport, on the foreboding Isle of Skye.\n\n"Talisker Storm" takes this most intense of experiences to a new level. The sweet warmth and briny, peppery finish that are the symbol of the Talisker character have been carefully accentuated through a skilful blend of differing ages Talisker casks.\nThe profound maritime character achieves a deeper intensity, like a warm welcome form a wild Hebridean sea.', 'Single Malt Scotch Whisky', 'Talisker Distillery,\nCarbost,\nIsle of Skye,\nIV47 8SR,\nScotland.', 'Talisker Distillery,\nCarbost,\nIsle of Skye,\nIV47 8SR,\nScotland.\nwww.malts.com', '', '', '', '', '', '18 Years (Statutory)', 'Packing - Recyclable ', '', '', '308', '100', '98', 'Gross Weight: 13', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:17', '2016-06-20 01:51:17', NULL),
(604, 604, 'AGUI001', 0, '2016-04-27', 'Off Licence', 'Sprits & Liqueurs', 'Vodka', 'Cîroc', '', 'Cîroc® Red Berry™ starts with Cîroc® Ultra-Premium Vodka, the first vodka ever to be produced from grapes, in France. Distilled five times to ensure high quality, the vodka is then blended with fresh raspberries and blackberries. The blending of luscious berry flavours makes this the perfect addition to a cocktail or can be enjoyed on the rocks.\n\nA refreshingly different vodka experience', '', 'Red Berry Flavoured Vodka', 'Diageo,\nLakeside Drive,\nPark Royal,\nLondon,\nNW10 7HQ.', 'Diageo,\nLakeside Drive,\nPark Royal,\nLondon,\nNW10 7HQ.', '', '', '', '', '', '18 Years (Statutory)', 'Bottle - Recyclable ', '', 'Contains alcohol', '320', '75', '75', 'Gross Weight: 14', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:17', '2016-06-20 01:51:17', NULL),
(605, 605, 'AGUI001', 0, '2016-04-27', 'Off Licence', 'Sprits & Liqueurs', 'Gin', 'Gordon''s', '', 'Refreshing Gordon''s London Dry gin is combined with the delicate taste of elderflower for a delicious twist on a great British classic. 70cl 37.5%\n\nGordon''s with a spot of Elderflower is a fragrant gin which adds the delicate notes of elderflower to the clean, pure taste of Gordon''s… like summer in a glass.\n\nGreat for long drinks; pour it over ice and apple juice for a delicious combination that gives off floral, fruity notes. Or create G&T''s with the scent of an English country garden and garnish with a strawberry... delightful!\n\nIt''s perfect for cocktails too. Shake up an Elderflower Fizz or an Elderflower Collins. Or pair it with blackberry for a zingy Elderflower Bramble.', 'To savour the great taste for yourself, mix a Gordon''s Spot of Elderflower Gin with Tonic and garnish with a halved strawberry. It''s the classic long mixed drink, ideal any time, but especially good when enjoyed with friends.', 'Elderflower Gin', 'Tanqueray Gordon & Co.,\nLakeside Drive,\nNW10 7HQ.', 'Tanqueray Gordon & Co.,\nLakeside Drive,\nNW10 7HQ.', '', '', '', '', '', '18 Years (Statutory)', 'Packing - Recyclable ', '', '', '254', '83', '68', 'Gross Weight: 10', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:17', '2016-06-20 01:51:17', NULL),
(606, 606, 'AGUI001', 0, '2016-04-27', 'Off Licence', 'Sprits & Liqueurs', 'Whisky', 'Bell''s', '', 'Bell''s Blended Scotch Whisky comes from some of the finest malt whiskies in Scotland - from the fresh, sweet malts of Speyside to the smoky sea salt of the Islands - all matured in selected oak casks for a richer flavour. The malt at the heart of the Bell''s blend is rich, spiced and nutty, and comes from our home, the Blair Athol distillery.\n\nTaste Great With....\nWhy not try it with Ginger Ale?\nTastes great with Cola.', '', 'Original Blended Scotch Whisky', 'Arthur Bell & Sons,\nEdinburgh,\nEH12 9DT,\nScotland.', 'Consumer Care Line 0845 6015340\nArthur Bell & Sons,\nEdinburgh,\nEH12 9DT,\nScotland.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '299', '78', '78', 'Gross Weight: 10', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:17', '2016-06-20 01:51:17', NULL),
(607, 607, 'AGUI001', 0, '2016-04-27', 'Off Licence', 'Beer & Cider', 'Other Lager/Beer', 'Guinness', '', 'With over two centuries of expert brewing craft behind it, Guinness hardly needs any introduction.\n\nOne of the world''s best-loved beers, from the first velvety sip to the last, lingering drop, every deep-dark satisfying mouthful in between is pure beauty… pure Guinness.', 'Serve extra cold.\n\nTilt the glass at 45 degrees, pour slowly, let the surge settle and enjoy.', 'Beer', 'Guinness & Co.,\nLondon,\nNW10 7HQ.', 'Guinness® Draught Stout Helpline: 08457 882277\nGuinness & Co.,\nLondon,\nNW10 7HQ.\nwww.guinness.com', '', '', '', '', '', '18 Years (Statutory)', 'Packing - Recyclable ', '', '', '161', '133', '133', 'Gross Weight: 18', '', '', 'Contains Barley', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:17', '2016-06-20 01:51:17', NULL),
(608, 608, 'AGUI001', 0, '2016-04-27', 'Off Licence', 'Sprits & Liqueurs', 'Cream Liqueurs', 'Baileys', '', 'The great taste of Baileys is consistently delivered by combining the finest ingredients in a unique and patented recipe\nThe whiskey in Baileys complements the richness of the fresh dairy cream, cocoa and heavenly vanilla that results in a luxurious, velvety smooth taste sensation.\nBest served over ice or delicious with coffee or in desserts. Baileys is the only cream liqueur that guarantees it''s taste for 2 years', '', 'Original Irish Cream', 'Diageo Great Britain Ltd.,\nLakeside Drive,\nPark Royal,\nLondon,\nNW10 7HQ.', 'Diageo Great Britain Ltd.,\nLakeside Drive,\nPark Royal,\nLondon,\nNW10 7HQ.\nFreephone no. 0 800 78 78 11\nbaileys.com', '', '', '', '', '', '18 Years (Statutory)', 'Packing - Recyclable ', '', '', '284', '86', '86', 'Gross Weight: 12', '', '', 'Contains Milk', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:18', '2016-06-20 01:51:18', NULL),
(609, 609, 'AGUI001', 0, '2016-04-27', 'Off Licence', 'Sprits & Liqueurs', 'Whisky', 'Talisker', '', 'Powerful and spicy, with a peppery finish and a touch of smokiness, Talisker is the award-winning malt whisky from the Isle of Skye.\n\nThe warm, subtle smoky quality of Talisker 10 Year Old is best appreciated neat, though a drop of water opens out its seawater saltiness - and serving it over ice enhances its subtle, sweet citrus flavours. \n\nWant something particularly special? Try Talisker Storm; delicious with a drop of water to broaden its salty maritime flavours. Then there''s Talisker Distillers Edition, smooth and rich, with distinctive sherry notes.', '', 'Single Malt Scotch Whisky 10 Year Old', 'Talisker Distillery,\nCarbost,\nIsle of Skye,\nIV47 8SR,\nScotland.', 'Talisker Distillery,\nCarbost,\nIsle of Skye,\nIV47 8SR,\nScotland.\nwww.malts.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '307', '99', '98', 'Gross Weight: 13', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:18', '2016-06-20 01:51:18', NULL),
