(618, 618, 'ACON003', 0, '2016-05-09', 'Off Licence', 'Red Wine', 'Others', 'Concha y Toro', '', 'Winemaker''s Notes\nA smooth, full-bodied Cabernet Sauvignon with cassis and black cherry flavours, complemented by hints of coffee and dark chocolate.', '"More than 100 years ago, Don Melchor de Concha y Toro reserved for himself an exclusive batch of his best wines. To keep strangers away from his private reserve, he spread the rumor that the Devil lived in that place. Hence the name: Casillero Del Diablo, The Devil''s Cellar".', 'Cabernet Sauvignon - Red Chilean Wine', 'Produced and bottled by:\nViña Concha y Toro S.A.,\nNueva Tajamar 481,\nTorre Norte Piso 15,\nSantiago.', 'Concha y Toro UK Ltd.,\nOxfordshire,\nEngland,\nOX33 1ER,\nU.K.\nwww.casillerodeldiablo.com', '', '', '', '', '', '18 Years (Statutory)', 'Bottle - Glass - Widely Recycled ', '', '', '305', '77', '77', 'Gross Weight: 12', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:18', '2016-06-20 01:51:18', NULL),
