(622, 622, 'AMAR026', 0, '2016-06-01', 'Off Licence', 'White Wine', 'New Zealand', 'The Ned', '', 'Harvest 2015 will long be remembered for the one in 85 year drought and smaller than average crops resulted.  The growing season provided some technical challenges but the end result was outstanding quality wines.\n', 'Situated in the Waihopai Valley of Marlborough, the Marisco Vineyards comprise of a complex range of soils running across ancient river bed terraces with a unique climate.  This combination of soils and climate allows us to produce classic styles of Sauvignon Blanc and Pinot Grigio - showing elegance and fruit purity. \n', 'Pinot Grigio - New Zealand White Wine', 'Produced and bottled by:\nMarisco Vineyards Limited,\nGuernsey Rd,\nMarlborough,\nNew Zealand.', 'www.marisco.co.nz', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '299', '81', '81', 'Gross Weight: 11', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:18', '2016-06-20 01:51:18', NULL),
(623, 623, 'AMAR026', 0, '2016-06-01', 'Off Licence', 'White Wine', 'New Zealand', 'The Ned', '', 'With one of the warmest starts to a growing season since records began all of the industry talk was of a super early, highly condensed harvest development. As it turned out harvest dates were fairly comparable to 2014 due mainly to the months of January through April being cooler and drier than average.\n', 'Situated in the Waihopai Valley of Marlborough, the Marisco Vineyards comprise of a complex range of soils running across ancient river bed terraces with a unique climate.  This combination of soils and climate allows us to produce classic styles of Sauvignon Blanc and Pinot Grigio - showing elegance and fruit purity. \n', 'Sauvignon Blanc - White New Zealand Wine', 'Produced and bottled by:\nMarisco Vineyards,\nGuernsey Road,\nMarlborough,\nNew Zealand.', 'Marisco Vineyards,\nGuernsey Road,\nMarlborough,\nNew Zealand.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '332', '57', '57', 'Gross Weight: 93', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:18', '2016-06-20 01:51:18', NULL),
(624, 624, 'AMAR026', 0, '2016-06-01', 'Off Licence', 'White Wine', 'New Zealand', 'The Ned', '', 'Harvest 2015 will long be remembered for the one in 85 year drought and smaller than average Sauvignon Blanc crops that resulted. The growing season provided some technical challenges but the end result was outstanding quality wines.\n', 'Situated in the Waihopai Valley of Marlborough, the Marisco Vineyards comprise of a complex range of soils running across ancient river bed terraces with a unique climate.  This combination of soils and climate allows us to produce classic styles of Sauvignon Blanc and Pinot Grigio - showing elegance and fruit purity. ', 'Sauvignon Blanc - White New Zealand Wine', 'Produced and bottled by:\nMarisco Vineyards Limited,\nGuernsey Rd,\nMarlborough,\nNew Zealand.', 'www.marisco.co.nz', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '299', '81', '81', 'Gross Weight: 11', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:18', '2016-06-20 01:51:18', NULL),
(625, 625, 'AMAR026', 0, '2016-06-01', 'Off Licence', 'Red Wine', 'New Zealand', 'The Ned', '', 'Sourced from the renowned Ben Morven and Slopes vineyards, the 2014 vintage was naturally low yielding, with a long ripening period that has ensured optimal fruit expression and super supple tannin.\n', 'Our Pinot Noir vines are planted in the deep clay loams of the Southern Valleys, universally regarded as the finest Pinot Noir terroir in Marlborough. The vines are cane pruned and meticulously tended to achieve a naturally balanced crop of intensely flavoured fruit.\n', 'Pinot Noir - Red New Zealand Wine', 'Produced and bottled by:\nMarisco Vineyards Limited,\nGuernsey Rd,\nMarlborough,\nNew Zealand.', 'www.thened.co.nz', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '299', '81', '81', 'Gross Weight: 12', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:18', '2016-06-20 01:51:18', NULL),
