(645, 645, 'AJRN001', 0, '2016-05-12', 'Off Licence', 'Sprits & Liqueurs', 'Gin', 'Bulldog', '', 'A brazen breed, perfectly balanced with natural poppy, dragon eye and hints of crisp citrus. \nBulldog guards the time-honoured tradition of distilling meeting all opposition with brilliant character and a palatable disposition.\nRespect its spirit and it will remain forever loyal.', '', 'London Dry Gin', 'Campari UK,\nThe Shard,\n32 London Bridge Street,\nLondon,\nSE1 9SG.', 'Campari UK,\nThe Shard,\n32 London Bridge Street,\nLondon,\nSE1 9SG.\nwww.BulldogGin.com', '', '', '', '', '', '18 Years (Statutory)', 'Bottle - Glass - Widely Recycled ', 'Kosher', '', '223', '94', '94', 'Gross Weight: 13', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:19', '2016-06-20 01:51:19', NULL),
(646, 646, 'ACOP001', 0, '2016-05-12', 'Off Licence', 'White Wine', 'Others', 'I Heart', '', 'This is a light, crisp, dry white with delicate citrus fruit aromas, lemon and lime flavours, with great balance and freshness on the palate.', 'We''ve sourced our wines from some of the most famous, top quality wine producing regions in the world. The mission was simple, to make a great quality wine that we are sure you will enjoy. We didn''t find this hard. We have found something that captures all we love about good wine right here in this bottle. Perfect for every occasion we love.\n\nWe love wine. We love everything about wine. We love that there is always something new to try. It might be a grape variety, a style, a country or even an unusual food match. This range is a collection of some our favourite wines. All you have to do is follow your heart and pour yourself a glass.', 'Pinot Grigio - White Romanian Wine', 'Bottled by:\nCramelle Recas SA,\n307340,\nRomania.', 'Copestick Murray,\nSN8 4AN,\nUK.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '302', '74', '74', 'Gross Weight: 11', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:19', '2016-06-20 01:51:19', NULL),
(647, 647, 'ACOP001', 0, '2016-05-12', 'Off Licence', 'Red Wine', 'Others', 'I Heart', '', 'This a ripe, fruity, medium-bodied red with smooth black fruit aromas and plum and raspberry fruit flavours, finished with a hint of spice.', 'We''ve sourced our wines from some of the most famous, top quality wine-producing regions in the world. The mission was simple, to make a great quality wine that we are sure you will enjoy. We didn''t find this hard. We have found something that captures all we love about good wine right here in this bottle. Perfect for every occasion we love.\n\nWe love wine. We love everything about wine. We love that there is always something new to try. It might be a grape variety, a style, a country or even a left-field food match. This range is a collection of some of our favourite wines. All you have to do is follow your heart and pour yourself a glass.', 'Merlot - Red Spanish Wine', 'Copestick Murray,\nSN8 4AN,\nUK.', 'Copestick Murray,\nSN8 4AN,\nUK.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '309', '76', '76', 'Gross Weight: 12', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:19', '2016-06-20 01:51:19', NULL),
(648, 648, 'AGUI001', 0, '2016-05-13', 'Off Licence', 'Sprits & Liqueurs', 'Whisky', 'Bulleit Bourbon', '', 'Bulleit Bourbon is a Kentucky straight bourbon whiskey whose high-rye content and iconic frontier inspired bottle is a favourite among bartenders and mixologists across the world. When Tom Bulleit set out to make a bourbon unlike any other, he was inspired by a recipe created by his great-great grandfather Augustus Bulleit more than 175 years ago.  Crafted using pure limestone-filtered water and charred American oak barrels for all of the colour and some of the flavour, Bulleit is especially high in rye content, giving it a bold, spicy character with a distinctively smooth, clean finish.', '', 'Frontier Whiskey', 'Diageo,\nLakeside Drive,\nPark Royal,\nLondon,\nNW10 7HQ.', 'Diageo,\nLakeside Drive,\nPark Royal,\nLondon,\nNW10 7HQ.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:19', '2016-06-20 01:51:19', NULL),
