(654, 654, 'ACAR001', 0, '2016-05-25', 'Off Licence', 'Beer & Cider', 'Standard Lager', 'Carlsberg', '', 'Little Leaf, Big Flavour\nWe''ve always known that little things can make a big difference. Now we''re putting another little detail under the microscope: Carlsberg''s Hop Leaf. It''s been a small part of our iconic logo for well over 100 years. It stands, of course, for the purity and quality of the natural ingredients we use to make the best beers you can possibly enjoy.', '', 'Lager', 'Carlsberg UK Ltd,\nNorthampton,\nNN1 1PZ.', 'Carlsberg UK Ltd,\nNorthampton,\nNN1 1PZ.\nConsumer Helpline: 03457 585685\nwww.carlsberg.co.uk', '', '', '', '', '', '18 Years (Statutory)', 'Box - Card - Widely Recycled \nCan - Metal - Widely Recycled \nFilm - Plastic - Recycle with carrier bags at larger stores - Not at Kerbside ', '', '', '200', '334', '152', 'Gross Weight: 70', '', '', 'Contains Barley', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:20', '2016-06-20 01:51:20', NULL),
(655, 655, 'AGUI001', 0, '2016-05-20', 'Off Licence', 'Sprits & Liqueurs', 'Other Liqueurs', 'Captain Morgan', '', 'Expertly blended with rich spice and natural flavours, Captain Morgan Original Spiced Gold is a premium spirit drink made with the finest Caribbean Rums.\nThe legendary mix is best served in a tankard over ice, with Cola and a slice of lime - perfect to enjoy with your favourite crewmates.\nCaribbean rum, adventurous spices and natural flavours are blended and aged in charred white oak barrels to create a rich colour and taste.\nNotes of rich natural vanilla, brown sugar, dried fruit, warming spices and hints of oak come together to create a perfectly balanced spirit with a smooth finish. The flavours also match well with lemonade and apple juice, or with fiery ginger ale. For the adventurous, why not add a spicy kick to your favourite rum cocktail?\nCaptain Henry Morgan was a legendary figure in the Caribbean. After years at sea as a Buccaneer, he was appointed governor of Jamaica, party capital of land and sea, in 1680. The spirit of Sir Henry Morgan lives on in his legendary rum drinks.\nLive Like the Captain!', '', 'Original Spiced Gold', 'Captain Morgan Rum Company,\nLakeside Drive,\nPark Royal,\nLondon,\nNW10 7HQ.', 'Captain Morgan Rum Company,\nLakeside Drive,\nPark Royal,\nLondon,\nNW10 7HQ.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:20', '2016-06-20 01:51:20', NULL),
(656, 656, 'AWES025', 0, '2016-05-24', 'Off Licence', 'Sprits & Liqueurs', 'Vodka', 'Finlandia', '', '', 'Finlandia is a premium vodka from Finland, enjoyed in cocktails around the world.\n\nMade from pure glacial spring water and the finest Finnish six-row barley that is grown under the Midnight Sun, Finlandia is a pure and delicate vodka with a crisp, clean taste.\n\nThe perfect ingredient for refreshing long drinks, try Finlandia over ice with soda water and a squeeze of fresh lime.\n\nGold Medal winner in the San Francisco World Spirits Competition 2015\n\n70cl bottle. 28 serves per bottle.', 'Vodka', 'Brown-Forman Beverages Europe Ltd.,\n45 Mortimer Street,\nLondon,\nW1W 8HJ,\nUK.', 'Brown-Forman Beverages Europe Ltd.,\n45 Mortimer Street,\nLondon,\nW1W 8HJ,\nUK.\nwww.finlandia.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '317', '78', '78', 'Gross Weight: 12', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:20', '2016-06-20 01:51:20', NULL),
(657, 657, 'ACOP001', 0, '2016-06-06', 'Off Licence', 'White Wine', 'German', 'I Heart', '', 'Crisp and bubbly, a sparkling wine with a kick of juicy flavours and fruit aromas.', 'We''ve sourced our wines from some for the best wine producing regions in the world. The mission was simple, to make a great wine that we are sure you will enjoy. We didn''t find this hard. We have found something that captures all we love about good wine right here in this bottle. Perfect for every occasion we love.\n\nHere at I heart we put our passion into creating straight-talking, great tasting wines for you to simply enjoy, whatever the occasion.', 'Sparkling German Wine', 'Bottled by:\nHenkell & Co.,\nSektkellerei Kg,\n65187 Wiesbaden,\nGermany.', 'Copestick Murray,\nSN8 4AN,\nUK.', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '314', '85', '85', 'Gross Weight: 13', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:20', '2016-06-20 01:51:20', NULL),
