(674, 674, 'AGUI001', 0, '2016-05-31', 'Off Licence', 'Sprits & Liqueurs', 'Cognac & Rum', 'Captain Morgan', '', 'Blended to an age-old recipe, Captain Morgan is the product of Caribbean sugar cane; its dark colour and rounded caramel and vanilla notes making it deliciously recognisable.\n\nAfter being triple distilled, Captain Morgan is matured in charred American oak barrels that help to create its distinctive dark qualities, rich layers of flavour and harmonious blend of clove and caramel notes.\n\nCaptain Morgan works brilliantly with a wide range of mixers, particularly lemonade and ginger ale; juices such as orange, apple, cranberry and pineapple; and cola, where its vanilla flavours are deliciously accentuated.', '', 'Dark Rum', 'Captain Morgan Rum Distillers,\n201 Talgrath Road,\nLondon,\nW6 8BN.', 'Captain Morgan Rum Distillers,\n201 Talgrath Road,\nLondon,\nW6 8BN.\nVisit the Captain at: www.rum.com', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:20', '2016-06-20 01:51:20', NULL),
