(676, 676, 'AGUI001', 0, '2016-06-01', 'Off Licence', 'Sprits & Liqueurs', 'Gin', 'Gordon''s', '', 'Gordon''s Gin is the world''s best-selling London Dry Gin.  Its juniper and citrus influenced character has earned it the reputation as the ginniest of gins\nGordon''s classic style, makes it the perfect gin for the definitive gin and tonic.  \nGordon''s gin is an icon of quality and most recognised and loved gin brand in the UK\nTaste Profile: Juniper forward gin, which when mixed with tonic water and served with a slice of lime, gives a crisp refreshing tasting gin and tonic\nThe distinctively refreshing taste comes from using only the finest ingredients including juniper, coriander seeds and angelica root\nEstablished in 1769, Gordon''s has 247 years of distilling heritage and has been awarded 4 royal warrants, the first of which was in 1925 by King George V', 'Gordon''s gin was established in 1769 by Alexander Gordon as he set out on a mission to produce a gloriously-flavoured gin worthy of carrying his family name. Gordon believed that success lay in the perfect combination of pure distilled grain spirit and rich botanicals. To this day Gordon''s is distilled to this same exacting standard, the product is triple distilled to guarantee the purity of the gin, and the exact blend of our botanicals remains a closely guarded secret. The attention to detail results in a distinctive that mixes perfect in long mixed drinks and cocktails.\n\nTo savour the great taste for yourself, mix a Gordon''s & Tonic and garnish with lime. It''s the classic long mixed drink, ideal any time, but especially good when enjoyed with friends.', 'The Original Special Dry London Gin', 'Tanqueray Gordon & Co.,\nOffice 2,\n78 Marylebone High Street,\nLondon,\nW1U 5AP.', 'Tanqueray Gordon & Co.,\nOffice 2,\n78 Marylebone High Street,\nLondon,\nW1U 5AP.\nCareline: 0845 601 4882', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '93', '42', '23', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:21', '2016-06-20 01:51:21', NULL),
(677, 677, 'AGUI001', 0, '2016-06-01', 'Off Licence', 'Sprits & Liqueurs', 'Vodka', 'Smirnoff', '', '"Smirnoff No.21 is the world''s No.1 vodka. Its classic taste has inspired other varieties throughout all four corners of the globe. Triple distilled and ten times filtered, every single drop of Smirnoff No.21 takes 8 hours to filter through Northern European hardwood charcoal in a 10 stage process. The highest quality de-mineralised water is used - which is filtered, de-ionised & checked 7 times for quality."', '', 'Premium Vodka', 'The Smirnoff Co.,\n8 Henrietta Place,\nLondon,\nW1G 0NB.', 'The Smirnoff Co.,\n8 Henrietta Place,\nLondon,\nW1G 0NB.\nwww.smirnoff.com\nConsumer Careline 0845 6014558', '', '', '', '', '', '18 Years (Statutory)', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:21', '2016-06-20 01:51:21', NULL),
