(684, 684, 'ASCB007', 0, '2016-06-06', 'Off Licence', 'Beer & Cider', 'Cider', 'Strongbow', '', 'Crafted in Herefordshire with our unique blend of British bittersweet cider apples, Strongbow Cloudy Apple is our fresh new take on traditional cloudy cider.\n\nBursting with crisp apple taste and a greater depth of flavour, this new sparkling cider delivers our signature cut through refreshment.', '', 'Sparkling Cloudy Apple Cider for Intense Refreshment.', 'HP Bulmer Ltd.,\nHereford,\nHR4 0LE.', 'HP Bulmer Ltd.,\nHereford,\nHR4 0LE.\nwww.strongbow.com\nukcustomerservices@strongbow.com\nConsumer Careline 0345 303 0351', '', '', '', '', '', '18 Years (Statutory)', 'Can - Metal - Widely Recycled ', '', '', '151', '133', '133', 'Gross Weight: 18', '', '', 'Contains Sulphur Dioxide/Sulphites', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2016-06-20 01:51:21', '2016-06-20 01:51:21', NULL),
